campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 800, \"fields\": {\"priority\": 1, \"description\": \"The year is 2018. Millions of German teenagers protest in the streets. Fridays For Future demands for „Climate Justice“. In between all the frustration with the political status quo, your party experiences a vindication of its environmental policies and a gigantic polling surge. You've just been voted in as party leader – how do The Greens plan to capitalize on this 'wind of change'?\", \"likelihood\": 1.0, \"question_number\": \"1\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"Unfortunately for you, the surge doesn’t last. The Corona Pandemic hits in 2020, and quickly dominates the news, politics and daily life. Merkel regains popularity in leading the crisis response, although soon after, cracks start to show. With the Greens not governing on the federal level, you can do little in terms of actual policy - how do you frame your stance on the government's Covid policies?\", \"likelihood\": 1.0, \"question_number\": \"1\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"It’s finally 2021. It’s getting real - election season is here.<br>Although your momentum from 2018 has been stopped by Covid, the CDU still seems vulnerable with its own crisis in leadership post-Merkel. Meanwhile, The Greens are in second place, and you’re gonna have to discuss who’s going to be the first Green chancellor candidate. <br>You and your co-leader Robert Habeck plan to announce something next month: until then, what do you want to do in the meantime?\", \"likelihood\": 1.0, \"question_number\": \"2\"}},{\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"April 2021: After long discussion between yourself and Robert, you’ve come to an agreement with him. You both want to avoid a chaotic contest, and with a bit of wistfulness, he agrees to give you precedence to become chancellor candidate. The nomination of your party will now just be a formality.<br>Alright Annalena, you’re it! Now is the time to break the news and to give your announcement speech as the first ever Green chancellor candidate!\", \"likelihood\": 1.0, \"question_number\": \"3\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"After a messy contest, the CDU has chosen Armin Laschet over Markus Söder as their chancellor candidate. The bruising cockfight and the recent Mask scandal, where some of their MPs were caught selling overpriced medical masks, have cost the CDU a lot of support in the polls - hopefully, you can capitalize on this. Meanwhile, the SPD has chosen Olaf Scholz last year already to lead them into this pivotal race.<br> With all three main parties having chosen their candidates, it's time to decide on a general strategy for this pivotal race.\", \"likelihood\": 1.0, \"question_number\": \"4\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"With a Green chancellor now looking like a realistic option, many skeptics of the past are giving the party a second look. One issue that might make them suspect is foreign policy - The Greens historically stem from the pacifist movement, although there seemingly has been a change ever since Joschka Fischer was Vice Chancellor. As a foreign policy expert yourself, an interviewer asks you for your focus on Germany’s role in the world.\", \"likelihood\": 1.0, \"question_number\": \"5\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 801, \"fields\": {\"priority\": 1, \"description\": \"You’re invited to a talk show about immigration and refugees. Although tempers have cooled a bit since 2015, the discussion around Merkel's decision to welcome the refugees 6 years ago is still relevant - particularly for the AfD, who got driven into parliament on this issue in 2017. Germany is still a popular destination for many foreigners seeking a better life, yet the nation does not seem prepared for this. What stance do you take in this debate?\", \"likelihood\": 1.0, \"question_number\": \"2\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"May 2021: This might be your lucky break. Another scandal for the Grand Coalition: the Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. Berlin is now working on passing a stricter law - you’re participating in the debate about this in the Bundestag.\", \"likelihood\": 1.0, \"question_number\": \"6\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"The party has accepted your chancellor candidacy with great enthusiasm. Only your co-chair, Robert Habeck, seems a bit deflated - clearly he had his own ambitions, but stepped gracefully aside for you. However, it can’t be understated how popular he is, still topping you in the polls even. How do you plan to utilize him in your campaign?\", \"likelihood\": 1.0, \"question_number\": \"7\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"This shouldn’t have happened. Of all people, <i>Die Bild</i> just broke a “scandal” about you. </br>Over the past few years, you’ve received several payments from the Green Party for your activity as party leader. It wasn’t a lot of money, and it was perfectly legal - but you’ve forgotten to report them to the parliament on time. Given how the Greens are advocating for more transparency of MP’s earnings, this is an unnecessarily embarrassing faux-pas. The media immediately jumps on it, and asks for your comment.\", \"likelihood\": 1.0, \"question_number\": \"8\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"Climate action is the Green’s main topic. While many voters want stricter environmental policies, Germany is also the “country of cars”. Due to this, there’s a certain disconnect between the Greens' promise to lower CO²-emissions and the Germans' love for automobiles: in an interview, you’re asked what your policies might mean for the price of gasoline.\", \"likelihood\": 1.0, \"question_number\": \"9\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"Since 2005, long-time unemployed people in Germany get money from the state at the subsistence level, the so-called Hartz IV. However, the amount of this aid is quite small, and recipients receive sanctions if they are not looking for a job. Many people are not happy with this system that the Greens helped introduce - what is your stance nowadays?\", \"likelihood\": 1.0, \"question_number\": \"10\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 802, \"fields\": {\"priority\": 1, \"description\": \"With you as chancellor candidate, the Green campaign finally got going. One reason for your success might be your perceived pragmatism: the Realo-wing of the party has finally taken over and made the Greens electable for the average German. Others say, the increased salience of climate change has given the Green’s policies a new relevance in the political landscape. In an internal meeting you’re asked frankly: “How do we win this thing?”\", \"likelihood\": 1.0, \"question_number\": \"3\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"June 2021: Finally, you are officially named chancellor candidate by the Green convention. However, the media focuses on something different.</br> Once again, you’ve come under fire for a scandal. This time, it’s about your CV, in which you’ve seemingly amended some passages, due to them being unclear and inaccurate in some parts. The media, of course, takes you to task on this.\", \"likelihood\": 1.0, \"question_number\": \"11\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with Germany often perceived as surprisingly archaic in comparison to its neighbors, frequently seen on the tail end of statistics. The lockdowns in the wake of the Covid-pandemic have only made this more salient. What part of the Green program here do you want to emphasize?\", \"likelihood\": 1.0, \"question_number\": \"12\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"The German Autobahn is currently known for its lack of a speed limit. One often proposed measure to reduce carbon emissions is to change that, as your party has demanded time and time again. Of course, this is quite a contentious topic among carlovers, and yet again, you’re asked about this in an interview.\", \"likelihood\": 1.0, \"question_number\": \"13\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 803, \"fields\": {\"priority\": 1, \"description\": \"One salient issue is the topic of pensions, particularly in light of Germany's changing demographics. Currently, pensions are distributed from a fund financed by the current working populace. However, because the number of retirees seems to grow faster than the workforce, the system is thought to be unsustainable. How do you want to address this problem?\", \"likelihood\": 1.0, \"question_number\": \"4\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"July 2021: After months of work with your co-author Michael Ebmeyer, you finally published your book: “Jetzt. Wie wir unser Land erneuern”. Partially a biographic work, it provides a general outline for your view on the world. </br> Unfortunately, you’re once again the source of controversy, after allegations of plagiarism; using passages verbatim from internet sources or newspaper articles. The media is once again jumping on this, asking for your comment.\", \"likelihood\": 1.0, \"question_number\": \"14\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 804, \"fields\": {\"priority\": 1, \"description\": \"One of the more salient issues in the current political landscape across the western world is the question of rents, particularly for younger voters. Most economic and educational opportunities increasingly lie in the big cities of the country - where rent is constantly increasing, to the point where it becomes a serious political question. What is your answer to the housing question?\", \"likelihood\": 1.0, \"question_number\": \"5\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Catastrophe hits. The meteorological low-pressure area <i>Bernd</i> has hit Central Europe and made several rivers burst over their banks. Disastrous rain and floods are affecting large areas of Germany. Particularly endangered seems to be Armin Laschet's homestate, North Rhine-Westphalia. You are currently on vacation while the news breaks - your advisors recommend you to travel to the scenes of disaster instead.\", \"likelihood\": 1.0, \"question_number\": \"15\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"Post-flood cleanup operations are going on as the full devastation of the flooding becomes clear: 220 fatalities, 186 of those in Germany, the deadliest flood since 1962.\", \"likelihood\": 1.0, \"question_number\": \"16\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 805, \"fields\": {\"priority\": 1, \"description\": \"Your state chapter in the Saarland seems to have some problems with their list. In a fiery brawl about who should lead the Green list there, after several resignations, former state party chair Hubert Ulrich seemed to have won the top spot against Green Youth chair Jeanne Dillschneider. The result was controversial, with party statutes nominally mandating a woman for the top spot - now, many are calling for action.\", \"likelihood\": 1.0, \"question_number\": \"6\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"It’s now less than two months until the election, and the campaign is heating up. It’s time to hit <b>The Campaign Trail</b>! In your travels around the country, what region do you want to focus your efforts on over the next few weeks?\", \"likelihood\": 1.0, \"question_number\": \"17\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"August 2021: After early successes, the vaccination campaign has become sluggish in recent weeks. Most vulnerable groups have been taken care of, but some vaccine-critical or lethargic people have been on the holdout for their shot. What should be done about that in your opinion?\", \"likelihood\": 1.0, \"question_number\": \"18\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 806, \"fields\": {\"priority\": 1, \"description\": \"A bit of a minor issue, but one that has gripped the imagination of many young voters is the topic of cannabis. Currently, it is a controlled substance, and illegal to produce, distribute or own. In light of worldwide movements to decriminalize or even legalize it: <i>Wann Bubatz legal</i>?\", \"likelihood\": 1.0, \"question_number\": \"7\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"Early in the campaign, it looked like you were the woman that could beat Laschet and  deliver a new era not just for The Greens, but also Germany. But as people increasingly look at the polling, they become doubtful. Voters are seemingly starting to give Olaf Scholz and the SPD a second look, providing him with a dramatic surge at the end of this race - at your cost.\", \"likelihood\": 1.0, \"question_number\": \"19\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"A staple for every election season is the topic of taxes. </br>The Greens have an ambitious program with quite a few investments, particularly on climate change. Many people, particularly fiscal conservatives, wonder how you want to finance all those programs. In your next interview you’re asked frankly: do you want to raise taxes to achieve that?\", \"likelihood\": 1.0, \"question_number\": \"20\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"There are 7 parties poised to enter parliament, and none has ever won an absolute majority since Adenauer in 1957. As such, it is basically guaranteed that there will be a coalition government after the elections. Particularly salient are Laschets attacks that you would govern with the socialist party Die Linke, equating their radicalism with the AfD. As such, you are asked ad-nauseam - who would you enter a coalition with?\", \"likelihood\": 1.0, \"question_number\": \"21\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 807, \"fields\": {\"priority\": 1, \"description\": \"A defining social issue is the question of abortion. Currently, criminal law §218 disallows abortions generally, but decriminalizes them in case of rape, or if the pregnancy is under 12 weeks old. Additionally, §219a establishes an “ad ban” for doctors offering abortions. You’re asked for your stance on this controversial topic.\", \"likelihood\": 1.0, \"question_number\": \"8\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. Many loyal locals are left behind, as the Taliban are poised to make a comeback. The government is sharply criticized for its botched evacuation - what tone do you want to strike for your campaign in the wake of this situation?\", \"likelihood\": 1.0, \"question_number\": \"22\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"September 2021: Official TV debates are a relatively recent phenomenon in Germany, only being consistently organized since 2002. Now, for the first time in German history, there will be a three-way debate, a so-called “Triell”. You, Olaf Scholz and Armin Laschet are all invited. What is going to be your strategy?\", \"likelihood\": 1.0, \"question_number\": \"23\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. There are plenty of avenues to attack him and stun his momentum - which talking points do you emphasize?\", \"likelihood\": 1.0, \"question_number\": \"24\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 808, \"fields\": {\"priority\": 1, \"description\": \"Along with the <i> Triell </i>, another TV debate is commonly held among surrogates of the smaller parties; the so-called <i> Vierkampf </i>. While you have eclipsed the other Bundestag parties, it’s Janine Wissler of Die Linke, Christian Lindner of the FDP, Alice Weidel of the AfD and Alexander Dobrindt of the CSU, the smaller sister of the Union, debating about the issues of the day.\", \"likelihood\": 1.0, \"question_number\": \"9\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"The 26th of September is almost here. This has been a wild ride, and come what may, the Greens will have had a moment that will be talked about years from now. Hopefully, it hasn’t passed yet! In the final days of the campaign, you have a chance to get some support from a political ally. Who do you want to campaign with?\", \"likelihood\": 1.0, \"question_number\": \"25\"}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"The CDU/CSU had a massive scandal with some of their MPs selling overpriced medical masks earlier this year, while SPD chancellor candidate Scholz has been sharply criticized for his role in a cum-ex scheme of the Warburg Bank and the collapse of financial service provider Wirecard. As you find yourself their equal, do you plan to capitalize on this?\", \"likelihood\": 1.0, \"question_number\": \"26\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 744, \"fields\": {\"priority\": 1, \"description\": \"As the election comes closer, many voters are giving you a closer look. A big hold-up for many people to vote for the Greens is their perceived elitism. Your path in life seemingly doesn’t refute this: After university, you’ve gone pretty much straight into politics, without working a “normal job”. It may seem trite, but to voters of lower education, this seems out of touch. How do you plan to address this?\", \"likelihood\": 1.0, \"question_number\": \"27\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 745, \"fields\": {\"priority\": 1, \"description\": \"July 2021: After months of work with your co-author Michael Ebmeyer, you finally published your book: “Jetzt. Wie wir unser Land erneuern”. Partially a biographic work, it provides a general outline for your view on the world. </br> Unfortunately, it’s a source of controversy, namely: plagiarism; You’re accused of using passages verbatim from internet sources or newspaper articles. The media is asking for your comment.\", \"likelihood\": 1.0, \"question_number\": \"28\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 746, \"fields\": {\"priority\": 1, \"description\": \"After months of work with your co-author Michael Ebmeyer, you finally published your book: “Jetzt. Wie wir unser Land erneuern”. Partially a biographic work, it provides a general outline for your view on the world. You have put a lot of energy into finishing this manifesto - how do you plan to use it in your campaign?\", \"likelihood\": 1.0, \"question_number\": \"29\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 747, \"fields\": {\"priority\": 1, \"description\": \"August 2021: After early successes, the vaccination campaign has become sluggish in recent weeks. Most vulnerable groups have been taken care of, but some vaccine-critical or lethargic people have been on the holdout for their shot. What should be done about that in your opinion?\", \"likelihood\": 1.0, \"question_number\": \"30\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 748, \"fields\": {\"priority\": 1, \"description\": \"Throughout the campaign, Olaf Scholz and the SPD have tried to find their footing in the political landscape once more - but the momentum of your candidacy seems to have relegated them to the sidelines once and for all, at least for now. With the oldest party of Germany ailing away, what will be your strategy for the final few weeks of the campaign?\", \"likelihood\": 1.0, \"question_number\": \"31\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 749, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Armin Laschet, Minister-President of North Rhine-Westphalia and chancellor candidate of the CDU. He is a vulnerable candidate, having been criticized on many gaffes like Laschet’s Lacher. What do you want to emphasize?\", \"likelihood\": 1.0, \"question_number\": \"32\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 750, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to take the high road, and focus on making your case to the German people without mudslinging. There are many policies in the Green program, and you can employ different strategies of presenting yourself to the audience. How do you want to do that?\", \"likelihood\": 1.0, \"question_number\": \"33\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 809, \"fields\": {\"priority\": 1, \"description\": \"There’s been some media chatter, even fear mongering about you in the press. Even though you’re traditionally a Realo, you’ve been uncompromising in your leftist stances - some see this unwavering integrity as a recipe for success, while others believe it could be a detriment. In an internal meeting you’re asked frankly: “Is this the way our party should follow?”\", \"likelihood\": 1.0, \"question_number\": \"3\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 810, \"fields\": {\"priority\": 1, \"description\": \"Since the beginning of your leadership, the Green party was observed to have moved to the center. While some believe you’re finally ready to be regarded as a “Volkspartei”, others are fearful that you’re eroding their identity, similar to the SPD. In a tense internal meeting, you’re asked frankly: “Is this the way our party should follow?”\", \"likelihood\": 1.0, \"question_number\": \"3\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 751, \"fields\": {\"priority\": 1, \"description\": \"It’s now less than two months until the election, and the campaign is heating up. It’s time to hit <b>The Campaign Trail</b>! In your travels around the country, what region do you want to focus your efforts on over the next few weeks?\", \"likelihood\": 1.0, \"question_number\": \"17\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 752, \"fields\": {\"priority\": 1, \"description\": \"The 26th of September is almost here. This has been a wild ride, and come what may, the Greens will have had a moment that will be talked about years from now. Hopefully, it hasn’t passed yet! In the final days of the campaign, you have a chance to get some support from a political ally. Who do you want to campaign with?\", \"likelihood\": 1.0, \"question_number\": \"25\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 811, \"fields\": {\"priority\": 1, \"description\": \"There has been plenty of talk about your performance thus far as chancellor candidate. You have had numerous gaffes and your image is not as clean as it once was with the press. It might be sexism, it might be genuine concern; but fact of the matter is, many think Robert Habeck would have been a better candidate - and openly demand him to take over and save The Greens’ campaign. There have even been some public calls from lower level Green party officials asking for the same thing.\", \"likelihood\": 1.0, \"question_number\": \"10\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 812, \"fields\": {\"priority\": 1, \"description\": \"There has been plenty of talk about your performance thus far as chancellor candidate. You have had numerous gaffes and your image is not as clean as it once was with the press. It might be sexism, it might be genuine concern; but fact of the matter is, many think Robert Habeck would have been a better candidate - and openly demand him to take over and save The Greens’ campaign. Now, some inside your party cautiously show some interest in the idea.\", \"likelihood\": 1.0, \"question_number\": \"10\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 813, \"fields\": {\"priority\": 1, \"description\": \"There has been plenty of talk about your performance thus far as chancellor candidate. You have had numerous gaffes and your image is not as clean as it once was with the press. It might be sexism, it might be genuine concern; but fact of the matter is, many think Robert Habeck would have been a better candidate - and openly demand him to take over and save The Greens’ campaign.\", \"likelihood\": 1.0, \"question_number\": \"10\"}}, {\"model\": \"campaign_trail.question\", \"pk\": 814, \"fields\": {\"priority\": 1, \"description\": \"Recently, there have been several op-eds praising your vigor and passion for the issues. Your energized style of campaigning turns many heads between the boring Laschet and Scholz - your image of a strong woman with the scent of progress really does set you up as somewhat of a modern spin on Merkel herself.\", \"likelihood\": 1.0, \"question_number\": \"11\"}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4500, \"fields\": {\"question\": 800, \"description\": \"We are the opposite of the AfD. In times where the parliament pivots rightwards, where sexism and racism are back on the agenda, it's The Greens job to hold up high the left-liberal, emancipatory flag. If we can position ourselves as the primary voice for progressives, the media will focus on our values. And this is only the beginning.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4501, \"fields\": {\"question\": 800, \"description\": \"We need to put climate change into the center of every politic. We support „Fridays For Future“ – they want an awakening, because they know, this is about the future of all of us. Let's stand with them in the streets, protesting for a cleaner and safer tomorrow. And this is only the beginning.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4502, \"fields\": {\"question\": 800, \"description\": \"We aren't just firmly situated in the leftist camp - we need to become the leading party of the center-left. The SPD is weak, if we can position ourselves as the more credible option for disappointed Social Democrats, especially on social policy, we will supersede them as the party of the left spectrum. And this is only the beginning.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4503, \"fields\": {\"question\": 800, \"description\": \"We need a fresh breath of air after these 14 years of Merkel and GroKo's. The progressive, modern center is getting more and more carved out – all the more important it becomes to do optimistic politics. It's now our job to make a political and societal offer, as an alternative to the status quo. And this is only the beginning.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 718, \"description\": \"I want to detail my visions for the future in my new book: “Now - How we’re renewing our Country”. When I’ll release it this summer, I want it to be good - so I’ll focus all my energy on finishing it and making some touch-ups.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 718, \"description\": \"If I want to become chancellor, I have to have a clean presentation, and can’t afford any sloppiness, especially as a woman. I’ll make sure things like my finances are in order and my team will check if there are any problems with my website, or other stuff on the internet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 718, \"description\": \"My name recognition is not that high compared to Robert. I want to get out there, go to talk shows, give interviews, and generally make sure the German people know me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 718, \"description\": \"Friday for Future is capable of mobilizing a massive amount of people. We need to restart the “climate summer” and focus media attention on the environmentalist movement. I will visit some demonstrations and meet with the FFF-leadership to get them on our side.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 719, \"description\": \"Overall, we support the government’s policies. I will criticize their chaotic response, but we can not endanger societal cohesion: in contrast to the AfD, we’ll make it clear that we broadly stand behind all necessary measures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 719, \"description\": \"Since the beginning of the pandemic, there hasn’t been enough of a focus on children and families. We need to build the circumstances to return to regular schooling, we need tests in daycares and schools, as well as fight the lack of teachers. There has to be an educational package for all kids in this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 719, \"description\": \"While the lockdowns were absolutely necessary at the beginning of the pandemic, we should be mindful - there has to be a balance between freedom and safety. The curfews, for example, are a strong restriction of a basic right that might not be proportional - we always have to see if we can use milder methods.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 719, \"description\": \"We support measures to combat Covid, and we need to support those affected by the economic impacts, but during all this, we can not forget the climate crisis. Every summer gets warmer, and there won’t be a vaccine against climate change. Aid for industrial corporations should always be mindful of their ecological modernization.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 720, \"description\": \"With my candidacy, I want to make the whole country an offer —a compelling invitation to lead our diverse and prosperous nation into a bright future. Our politics needs courage to do things differently. A country that’s more just, in which daycare and schools are beautiful places, in which the state works digitally, and in which we have a foundation for welfare and security.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 720, \"description\": \"I want the politics of a new government to make climate change the benchmark for every area, to fulfill the goals of the Paris agreement. Forty years ago, the Green Party was founded to make our politics care more about the environment. Today, I continue in this tradition, as the only candidate that truly takes climate change seriously.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 720, \"description\": \"After eight years of Grand coalition and sixteen years of CDU chancellorship, we need change - we need to have a new political culture. A Green chancellor candidacy stands for a new understanding of political leadership. Yes, I haven’t been chancellor or Minister: I am running for a renewal. The status quo is represented by others.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 720, \"description\": \"The Greens are the new center. We need changes instead of promises - and now is a good time to lead a good government. Politics works in the concrete for the people: we need to do politics from the concrete and to provide agreeable policies, good compromises, for all of us. It can work!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 721, \"description\": \"It’s clear that the SPD is not going to win this election. I want to present myself as the main candidate of the left-of-center and try to coalesce left-wing voters around the Greens. If we can make this a one-on-one against Laschet, I’m sure our appeal to change will win over the status quo.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 721, \"description\": \"Traditionally, the Greens have been a left-of-center party. However, these are exceptional circumstances. We need to draw voters from our main competitor, the CDU - Armin Laschet is a weak candidate, and I can present myself as a competent alternative to the status quo that he embodies. We might have to amend our rhetoric on some topics to do this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 721, \"description\": \"Our base is largely young, urban, and well-off - with the right strategy, we can generate an enthusiasm unseen in past Federal Elections. They are frustrated, and we have actual credentials for them. We will put more resources into mobilization efforts to get the youth to turn out this election. Maybe we can get a Rezo-endorsement?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 721, \"description\": \"Our polling numbers in West Germany are great, but we are struggling to even get to 10% in many East German states. East Germany has been neglected by the status quo for a long time, and we might be able to present our ideas of change to an untapped voter potential there.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 722, \"description\": \"While we want to remain a member of NATO, of course, I am skeptical towards the goal to spend 2% of our gross domestic product on defense. We can’t just raise the defense budget, we need to improve our capabilities and prevent crises before they happen.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 722, \"description\": \"We have to be tougher on states that don’t care about human rights, like Russia and China. For example, I’m in favor of stopping the construction of the Nord-Stream 2 pipeline and stopping the import of products from China that might have been produced using forced labor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 722, \"description\": \"The Green Party has always been the party of pacifism. We need to overthink our levels of military spending and discuss if pure military alliances like NATO have any future. Instead, we should think more European.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 722, \"description\": \"I stand for a value-based foreign policy - particularly, a feminist foreign policy. We need to fight for the rights, ressources and representation of girls and women worldwide and strengthen societal diversity, to overcome violence and discrimination. A foreign policy that includes, not excludes. When women are safer, everyone is safer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4504, \"fields\": {\"question\": 801, \"description\": \"I supported Merkel's decision at the time, we needed to take those people in to prevent a humanitarian catastrophe at the Austrian-Hungarian border. Today though, we need to be more mindful of European border security. To that end, we want to strengthen the EU border enforcement agency Frontex.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4505, \"fields\": {\"question\": 801, \"description\": \"There’s no way around it - Germany is an immigration country. We need a comprehensive overhaul of our immigration laws - we don’t have a good system in place to attract qualified immigrants, who could be advantageous to our economy and demographic situation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4506, \"fields\": {\"question\": 801, \"description\": \"Merkel was absolutely right to take in these people. We say: Refugees Welcome! As a western country partially responsible for colonialism, we have a responsibility for humanitarian aid, including initiatives to rescue capsized refugee boats in the mediterranean.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4507, \"fields\": {\"question\": 801, \"description\": \"On this issue, Merkel has erred - her rhetoric was dangerous in provoking even more refugees and immigrants to come here. We simply can’t take everyone. We need more border security in the EU and faster deportation processes to avoid another disaster - 2015 can’t repeat itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 723, \"description\": \"We can’t hide behind goals and numbers, we need concrete measures! If you promise a forest, you need to plant the trees. We need a government that makes climate protection the core of every political action, with a rapid Climate Protection program! We wasted a lot of time in the last few years, and we need to make up for it with swift action.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 723, \"description\": \"The Federal Courts have given us a clear message: if you protect the climate, you’re protecting freedom. Five years ago, this house ratified the Paris climate accords. Every democratic party here agrees that something needs to be done, so let’s find solutions together.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 723, \"description\": \"This is no room for party-political games, we have an obligation to act here and today. The CDU has failed us for 16 years, and the SPD is complicit! Climate protection through Sunday speeches doesn’t suffice. They have failed to promote renewable energies and endangered countless jobs!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 723, \"description\": \"We have had many transformations in the history of this country: Introducing the social market economy after World War 2, the reunification and European integration after 1990. Now is the time for another transformation: a Green New Deal for Europe, in an alliance with the USA. This problem can only be solved internationally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 724, \"description\": \"Robert is a lovably stoic North German. As a former minister, he’s bound to be popular in his home state of Schleswig-Holstein - I want him to utilize his local connections and charm there, to give us the inroads with rural voters that we need. On the national stage however, I want myself to be center stage.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 724, \"description\": \"We are co-party leaders and I want to campaign a lot as a dynamic duo. While I’ll focus on climate protection, foreign policy and general leadership, he’s especially knowledgeable on economic and fiscal policy, so I want him to focus on his strengths there.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 724, \"description\": \"Robert ist the one with government experience here. I’ll mostly talk about my visions for the country, our Green ideology and our stance against the status quo, while he can focus on the policy details and explaining them to the common voter.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"As a woman, any critiques I’ll say will get torn up by the media as unlikeable and hysterical - just think of Hillary Clinton. Robert might be able to help us here - he can serve as our attack dog on Laschet and Scholz, while I remain above the fray with a positive attitude.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 725, \"description\": \"I will apologize for this mistake, I’ve reported these earnings now. This wasn’t a big deal, but it was still unnecessary and frustrating. This will not reflect my chancellorship - I hope people will quickly move on from this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 725, \"description\": \"I admit, this was a small lapse of judgment - but it’s nothing compared to the corrupt mask deals in the CDU/CSU and Scholz’ Wirecard and cum-ex scandals. I am still the candidate with the most integrity; I stand by my mistakes and fix them, while Laschet staves off critics and Scholz can’t even remember.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 725, \"description\": \"Other politicians have received much higher payments in the same timeframe, and also haven’t reported them. This is why the Green Party stands for more transparency regarding the earnings of MPs. Our party actually acts on these promises.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 726, \"description\": \"I grew up in the countryside myself, I know you need a car there - we broadly need a switch to cleaner cars though. If we want to lower our carbon emissions, under my plan, the price of gasoline has to rise by about 16 cents per liter over the next five years.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 726, \"description\": \"Mainly, we want to strengthen public transit and alternative sources of fuel. As the price of CO2 rises, so will the price of gasoline. We have to keep an eye on affordability, but unfortunately, a price hike is unavoidable. The question is, are we leaving everything the same, or will we finally change something?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 726, \"description\": \"As climate change gets worse, we need to be resolute. Gas prices have to rise a lot - around 28 cents per liter over the next five years. We need to invest in public transit as well to make individual traffic less attractive overall. Buses and trains are where our future lies.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 726, \"description\": \"With our crumbling public transport, cars are necessary for our rural population. After the price for CO2 went into effect at the beginning of the year, gas prices have risen by 6 cents per liter already - for now, this is enough. Climate protection still has to be affordable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 727, \"description\": \"We need to replace the Hartz IV-system with a “citizen’s money”, in which recipients would receive at least 50€ more. There should be no more sanctions if someone isn’t actively looking for a job, and there will be other reliefs, in the form of price caps on gas and electrical energy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 727, \"description\": \"The current level of Hartz IV is a disgrace. The system needs to be reworked from the ground-up, and needs to be a massive raise, by around 200€, accounting for inflation. The sanctions are also unnecessary and inhumane, they should end. We also need further aid, like basic child security funding.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 727, \"description\": \"Instead of Hartz IV, there should be a higher, universal basic income for all people in Germany, around 1200€ as a minimum income. While this is expensive, the savings on bureaucracy make it possible to finance this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 727, \"description\": \"The system needs some minor adjustments - we can look into gradually raising the amount of money paid out and lessen the applied sanctions. However, we have to be careful that it doesn’t become excessive - overall, the Hartz system is sound.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4508, \"fields\": {\"question\": 802, \"description\": \"There’s a wind of change blowing through Germany: climate change is finally taken seriously by the media. We are perceived as most competent on this issue - as long as we press the attack and define a solid profile on climate action, we can keep up our momentum all the way to election day.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4509, \"fields\": {\"question\": 802, \"description\": \"I think the people are tired of politics-as-usual, especially after 16 years of Merkel. I will run on an optimistic take - “Germany can do so much more”. Let’s stand by our stances and campaign on the issues without getting intimidated - ignore the mudslinging, and trust in our sympathy levels.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4510, \"fields\": {\"question\": 802, \"description\": \"Of course, people want change - but in order for them to follow through, we need to make our rhetoric and policies palatable to the average voter. Our goal is first place after all - Kretschmann showed us how it works in Baden-Württemberg. Let’s present ourselves as a stately new party, ready to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 728, \"description\": \"The most important points in my CV are accurate. I do apologize for these mistakes and the impression it unwillingly gave, but these errors have all been corrected now. I’ve learned my lesson. We can move on to other topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 728, \"description\": \"This is a non-issue. The main points are there, and this is just a misunderstanding. It’s clear what’s happening here: the media and my opponents are trying to derail our momentum by pushing nonsense-narratives on the only female in the race.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 728, \"description\": \"If you want to see my correct CV, just look at my website - I don’t get what people are getting so upset about. Everything on there is in order, there is no scandal here.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 728, \"description\": \"Oh come on… it was never my goal to embellish my CV, I just made some honest mistakes here. I have to admit, I'm really annoyed with myself for letting this slip through. That said, I’ve followed my responsibility and cleaned this up. I didn’t want to make myself seem greater than I am, and all I can do now is to keep earning your trust.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 729, \"description\": \"The Grand coalition has failed Germany in this regard, as was plain to see during the lockdowns. Under a Green government, we need to invest a lot of resources into modernizing the digital infrastructure of this country - including a right to a fast internet connection.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 729, \"description\": \"We need a great European cloud-infrastructure based on Open Source technology, to provide for a great amount of data for the development of AI. We need to invest into AI, to improve Germany as a location for High Tech businesses. We also need regulations around AI usage in art and science.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 729, \"description\": \"It’s disappointing how much government agencies still rely on old-fashioned methods. We have to invest massively to introduce more modern systems. We need to make non-personalized data public and to introduce a digital identity for every citizen on their phone - of course, protected by good IT-security.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 729, \"description\": \"We need to focus on data protection. Big Tech has to be regulated in its data usage, and our data has to be kept safe from American companies. We will defend the right for privacy, particularly in light of the information unveiled by Edward Snowden.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 730, \"description\": \"This is something I will fight for -  we need a general tempo limit of 130 km/h to reduce carbon emissions. We have to hit our emission targets somehow and reducing traffic emissions is one part of that - the situation won’t fix itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 730, \"description\": \"We need a “safety limit”: A lot of accidents and deaths could be avoided if people wouldn’t be speeding excessively. There are studies showing that with a tempo limit, the number of accidents and traffic victims decrease. This can save lives. It’s a matter of common sense.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 730, \"description\": \"We shouldn’t overestimate the effects of a tempo limit on climate change. With this being a divisive topic, we aren’t planning on focusing on this in the next legislative session. However, we will look into introducing new tempo limits on selected highways, as they already exist on certain streets.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 730, \"description\": \"To reach the climate goals for 2030, we need to massively save on CO² in our traffic. We need a general tempo limit of 130 km/h on highways, 80 km/h outside of cities and 30 km/h within city limits - this will have a crucial part in our fight against climate change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4511, \"fields\": {\"question\": 803, \"description\": \"The heart of this problem lies in Germany's low birth rates. We need to further encourage the founding of families, with benefits for married and childbearing couples. Family-friendly policies will strengthen our social cohesion and collective values and invest in our future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4512, \"fields\": {\"question\": 803, \"description\": \"A sustainable answer to keep our social support net afloat lies in immigration. We are an attractive place in Europe for many seeking a safe and economically secure future, and we should finally implement a real immigration law, for example with a Canada-style point-system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4513, \"fields\": {\"question\": 803, \"description\": \"It's clear that the current system is unsafe. We should build on our public pension system, reform the Riester-system, and refrain from raising the pension age any further than 67! We also need to introduce a higher state-provided minimum pension to fight old-age poverty.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4514, \"fields\": {\"question\": 803, \"description\": \"We need to overhaul the bureaucratic costs of the system and listen to the decisions of the advisory councils. The mix of public, occupational and private pension systems contributes to safe pension levels, particularly occupational and private provisions should be strengthened. We can also look at Swedish-style stock-based pension funds.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 731, \"description\": \"I’ve made some mistakes, yes, but these accusations from some conservative blogger are unfair and completely blown out of proportion. I will get a media lawyer to fight back- this comes close to character-assassination.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 731, \"description\": \"It was a mistake to publish the book in its current state and I apologize for this lapse in judgment. My intention was not to deceive anyone, I simply quoted widely available facts, and as this isn’t a scientific paper, I didn’t think a bibliography was necessary. Now, we should keep talking about the issues that matter most.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 731, \"description\": \"This book hasn’t been written by just me, I had a co-author. I’ll make it clear that most of the problematic parts were his responsibility and I didn’t have much to do with them - although I should’ve vetted him a bit better..\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"What a double standard. This is a popular non-fiction book, not a scientific article. Let’s point to Armin Laschet - in his 2009 book, there are several plagiarized passages, and they’re finding more and more. Why aren’t they talking about that?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4515, \"fields\": {\"question\": 804, \"description\": \"We need to alleviate the housing market by building more. We need to build more than 100.000 housing units, using tax benefits. We should also provide funding to revitalize our cities and villages, advertise rural spaces and reduce the real estate transfer tax - every family should be able to own a home.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4516, \"fields\": {\"question\": 804, \"description\": \"We need to emphasize the creation of more social housing, built by modern standards, available for those who need it most. For families, we can make buying empty buildings in the countryside easier for young people, as we do in NRW. Furthermore, we need to fight land speculation and close tax loopholes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4517, \"fields\": {\"question\": 804, \"description\": \"The situation is tense. It’s clear that action is needed in the form of rent controls. A sharper, unlimited federal rent control program should be introduced. In places where the situation is very problematic, we stand for a rent moratorium.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4518, \"fields\": {\"question\": 804, \"description\": \"Apartments are people's homes, not investments. We can’t afford half measures: we need a federal rent freeze in regions where the capitalist market failed, lower existing costs, if necessary with expropriations. We need new social housing units and the renovation of old buildings - we can even look at legalizing squatting, if it serves the reappropriation of misused spaces.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 732, \"description\": \"No, it would be improper to try to politicize this catastrophe. I’m going to enjoy my vacation and the time with my family - some small statements over social media and to the press should be enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 732, \"description\": \"My god, yes of course I will cancel the rest of my vacation. I have to travel to some of the affected regions, to take a look at the carnage myself - but let’s be careful and avoid opportunism. I’m gonna talk to our local ministers in Rheinland-Pfalz and take some trips to the sites of the catastrophe, but I don’t want any media accompaniment or any broad statements.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 732, \"description\": \"You’re right, I need to show my leadership during these tough times. Specifically, I want to meet with Minister of the Environment Anne Spiegel in Rhineland-Palatinate, and visit the Green Party mayors of Bonn and Wuppertal. I’ll look at the devastation and make a public statement with them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"You’re right, I can’t keep vacationing under these circumstances, but I also don’t want to seem opportunistic. What about a surrogate? Robert is good at talking to people in situations like this. Let’s ask him to go -  I’ll of course still comment on my own.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 733, \"description\": \"You know, we haven't been working on this topic since only yesterday. For decades, The Green Party has stood for a stronger stance on environmentalism. Germany is not prepared for the effects of climate change - that’s why we call, for example, for an end of using coal to produce electricity by 2030, as even Markus Söder does.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 733, \"description\": \"I don’t want to come across as wanting to profit from this disaster. After a short, expected mention of climate change, I will primarily talk about basic topics like introducing a better Cell Broadcasting system, a construction ban in areas with high risk of flooding and an overall better national disaster control strategy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 733, \"description\": \"I don’t just want to promise climate action, I want to make it concrete. We need to be more ambitious: to that end, I want to produce concrete proposals for centralized action against climate change, as well as unveil a decisive instant-climate-protection-program that we would enact in government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"I want to specifically call out Armin Laschet here - he said that a day like this is no reason to change the politics. What else does he need to see to realize that something must be done? We can’t afford this wish-wash by the Union on climate anymore.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4519, \"fields\": {\"question\": 805, \"description\": \"We need to resolve this quickly. Let’s invest some resources for a re-vote, to get Jeanne Dillschneider the top spot.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4520, \"fields\": {\"question\": 805, \"description\": \"We need to resolve this quickly. Let’s invest some resources for a re-vote, to get Jeanne Dillschneider the top spot.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4521, \"fields\": {\"question\": 805, \"description\": \"There are certainly more pressing matters than some power plays in the small Saarland. Let them deal with it on their own, I want to concentrate on the national campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4522, \"fields\": {\"question\": 805, \"description\": \"Let’s not get derailed - make them change the statutes so Ulrich can stay in the top spot. The delegates democratically voted for him, so we’ll have to accept this result. We can deal with anything further after the election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 734, \"description\": \"Robert Habeck is currently on a pretty popular tour across the North Sea coast. Let’s join him to show the unity of our party and produce some great pictures of us as the ‘dynamic duo’!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 734, \"description\": \"Winfried Kretschman, the only Green Minister-President, has just won his reelection this spring and is very popular, particularly among moderates and conservatives. In order to broaden our appeal and show off competent Green governance, I want to campaign with him in Baden-Württemberg and South Germany in general.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 734, \"description\": \"I’m quite content with our polling numbers in West Germany, but we are still far behind in East Germany. I don’t just want to be perceived as a chancellor of the west - to not get completely pummeled there, I want to focus my visits on the New States, to make them feel heard and activate traditional non-voters.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"The states of Berlin and Mecklenburg-Vorpommern have their state elections parallel to our federal elections. To further our standing as a national party, a good result is crucial there. As such, let’s campaign with our top candidates, Bettina Jarasch and Anne Shepley, to show off the strength of Green women!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 735, \"description\": \"If everyone has gotten an offer for a vaccine, we shouldn’t rule out that vaccinated people might be able to do more than the unvaccinated. It can’t be that the freedoms of everyone are getting restricted because some don’t want to get the shot.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 735, \"description\": \"We are doing a lot to get everyone vaccinated right now without thinking about the consequences. What if the vaccine is toxic? We shouldn’t underestimate alternative medicine, and we should support people’s freedom to choose homeopathic medicine instead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 735, \"description\": \"Mandatory vaccinations aren’t easy to implement - but we have to think of the alternatives. If our children have to undergo further lockdowns, we will need a general vaccine mandate in Germany, to protect them and those who did everything they could to uphold our medical system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"Overall, we are on the right path with the vaccination campaign. We need to do more to reach everyone though, including mobile vaccination teams that can provide coverage to areas with low vaccination rates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4523, \"fields\": {\"question\": 806, \"description\": \"Cannabis is a societal reality, like alcohol. We should start to take steps towards a regulated distribution to adults, accompanied by addiction prevention measures. The possession of small amounts shouldn’t be prosecuted anymore.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4524, \"fields\": {\"question\": 806, \"description\": \"We are against the legalization of illegal drugs. The risks for the individual and society are too great - instead, we should work towards addiction prevention, as well as early and suitable sanctions, that incentivise taking counseling and therapy. We do acknowledge the medical usage of Cannabis, however.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4525, \"fields\": {\"question\": 806, \"description\": \"Legalize it! We are for permitting the controlled distribution of Cannabis, through regulated sales in licenced shops. We do need projects to prevent drug abuse and youth protection though, financed through consumption taxes, as well as a legal framework around marihuana usage.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4526, \"fields\": {\"question\": 806, \"description\": \"We don’t just want to legalize Cannabis, but also decriminalize small amounts of hard party drugs like XTC, cocaine and amphetamines. The criminalization of drug consumers is a relic from the last century, the ‘right for intoxication’ should be self-evident.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 736, \"description\": \"I’m very concerned about this development. We need to become more visible, and turn some heads towards Scholz’ own vulnerabilities. In the next few weeks, I will focus on attacking him and his party on their broken promises and shady dealings like cum-ex and Wirecard.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 736, \"description\": \"Of course, I’m very disappointed about this. However, honestly, we are still very likely going to be part of the next government and I’d rather govern with Scholz than with Laschet. I don’t want to jeopardize this: instead, the two men won’t be able to refrain from attacks, and I'll calmly rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 736, \"description\": \"That’s too bad, but this is no time to get disheartened because of numbers. We know we are fighting for the right thing - let’s motivate ourselves and reinvent this campaign, new rallies, new posters, more media interviews: that way, we can heighten our visibility and draw a good contrast to Scholz’s unwavering borefest.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 737, \"description\": \"To finance necessary government spending, taxes on the rich have to be raised. We should reinstate the wealth tax and raise the income tax, but in a way that leaves small and medium-income earners unaffected.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 737, \"description\": \"Effectively combating climate change is our number one priority, and to finance this, there might have to be certain tax increases on goods like meat or dairy. The wealthy will of course have to bear the highest increase, but everyone will have to contribute more - if we invest in our future, the financial effort will come back manifold.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 737, \"description\": \"We need to raise taxes on the rich a bit, yes. However, more importantly, we need to abandon the ‘Black Zero’ and reform the debt ceiling in our constitution. It is economically sound to invest in certain projects, especially considering the current interest rates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 737, \"description\": \"Climate action doesn’t have to be expensive; particularly policies friendly to innovation, tax rebates for eco-friendly technologies and a higher CO²-price in emission trading can help us combat climate change without high expenditures. Of course, we are proposing more than that, but we’re sure that noticeable tax increases can be avoided.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 738, \"description\": \"We need to send the Union back to the opposition - they are the party of standstill. While we definitely advocate for a stricter line on climate change, the party we have the most overlap with is the SPD. In the end, maybe it’ll even be enough for an alliance solely between Green and Red.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 738, \"description\": \"While we of course disavow any cooperation with the AfD, I also can not imagine a good working relationship with Die Linke. I want to see an administration that takes responsibility in the world - if we don’t share common ground on foreign policy, there is no basis for a government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 738, \"description\": \"Equating Die Linke with the far right AfD, as the CDU does, is wildly dangerous. The best path to real change in our government lies in a cooperation of the three leftist parties: such an arrangement has worked in several states already, so I’m certain we can find compromises on contentious topics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 738, \"description\": \"This is a historic moment in our society and in our country; we need a restart in Germany’s governmental politics. The FDP is closer to us than many might think: we are both advocating for change. Together, we can drive a hard bargain against the old parties of the Grand Coalition.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4527, \"fields\": {\"question\": 807, \"description\": \"While §218 is a settled compromise from our societal discussions, we are for striking the §219a ad ban: women who are deciding on an abortion need unrestricted access to information. We also need to train more doctors and prevent pressure from abortion opponents in front of clinics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4528, \"fields\": {\"question\": 807, \"description\": \"We want to strike $218, 219 and 219a from the books completely. Pregnancy issues are not part of criminal law - abortion is a medical service that has to be managed as part of regular health care. The stigma has to be broken, and the supply of doctors offering abortion has to be increased.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4529, \"fields\": {\"question\": 807, \"description\": \"The current situation is fine as is. Unborn life does have a right to be protected. Furthermore, the ad ban has already been loosened two years ago, to provide better access to information for affected women and legal certainty for doctors and hospitals, if an abortion is necessary.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4530, \"fields\": {\"question\": 807, \"description\": \"We need to immediately strike § 218 and $ 219 - instead, the right to free, simple and accessible abortions has to be guaranteed; state-built hospitals should be required to perform the procedure. Furthermore, with contraceptives ensuring the right for self-determination, they should be fully covered by insurance.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 739, \"description\": \"Weeks ago, The Greens proposed to get local German staff to safety, but SPD and Union refused. The entire German Federal government, be it Foreign Minister, Minister of Defense, Chancellor and Vice-Chancellor have politically decided to prioritize internal political motives over our German foreign policy responsibilities. Both parties are at fault.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 739, \"description\": \"In these minutes, what counts is saving lifes. Now is not the time for electoral campaigns or demands for resignations - now, we need to do everything we can to bring the people who protected our soldiers to safety.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 739, \"description\": \"Only a few days before the fall of Kabul, Minister of the Interior Seehofer wanted to keep deporting people to Afghanistan. There are dozens of women’s rights advocates, children and families that we need to get out, take them in as refugees! We need to organize a summit of all NATO-members and Afghanistan’s neighbors to that end, now!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 739, \"description\": \"The Green Party is a party of pacifism, and we’ve been against this war in Afghanistan from the start. While the pictures are tragic and we need to do what we can to help, this whole episode shows why we shouldn’t get involved in these types of conflicts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 740, \"description\": \"Scholz has slowly climbed his way up again - he’s clearly the biggest obstacle to our success. Let’s focus on taking him down to take back the center-left lane.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 740, \"description\": \"This country needs a change in government, and Laschet is a vulnerable candidate. Let’s take him down once and for all and win this election!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 740, \"description\": \"I will leave petty attacks to my opponents and focus more on policy. I’m certain the German people will appreciate hearing concrete solutions to their problems more than attacks. This isn’t America.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 740, \"description\": \"The media has constantly discriminated against myself and my party. This debate will be biased towards the old, establishment parties, while those who advocate for change won’t be treated fairly. I refuse to participate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 741, \"description\": \"Olaf Scholz is the incumbent vice chancellor of the GroKo for the last four years: he’s complicit in the political standstill of this country.  People who want real change in this country have to look elsewhere!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 741, \"description\": \"I want to hit him on his scandals, both as finance minister and earlier. He mishandled the Wirecard collapse, was involved in the cum-ex banking scandal and had a disastrous response to the G20 meeting when he was mayor of Hamburg.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 741, \"description\": \"While we might agree on social or financial topics, the SPD is a hindrance in our fight against climate change. Scholz doesn’t even want to credibly speed up our exit from coal - 2038 is too late! These reactive politics are not progressive, and have to be voted out!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 741, \"description\": \"Actually, I’ve changed my mind. The mudslinging isn’t worth it - after giving my usual critiques of both candidates, I’ll just wing it and rely on my instincts as a progressive to rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4531, \"fields\": {\"question\": 808, \"description\": \"Let's see who can come out on top – it won't change much either way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4532, \"fields\": {\"question\": 808, \"description\": \"Let's see who can come out on top – it won't change much either way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4533, \"fields\": {\"question\": 808, \"description\": \"Let's see who can come out on top – it won't change much either way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4534, \"fields\": {\"question\": 808, \"description\": \"Let's see who can come out on top – it won't change much either way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 742, \"description\": \"Luisa Neubauer, the famous Fridays For Future activist, is a member of our party, but she’s been inactive. Maybe we can change that - I want to ask her to appear with us, in an official statement of support. I want to speak to the German youth that brought us where we are today, in some rallies all across Germany’s cities.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 742, \"description\": \"If there is one Green name that’s as important as mine these days it’s “Robert Habeck”. For the whole campaign, Robert was a loyal compatriot. We are the faces of our party, and with his outstanding people-skills, I want to rally with him to show what the Greens have to offer, all across Northern Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 742, \"description\": \"There will be state elections in Berlin and Mecklenburg-Vorpommern parallel to the federal elections. To project confidence and strength, I want to appear with Bettina Jarasch in Berlin to help make her the second Green head of state government. This is only the beginning of a Green decade in Europe!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 742, \"description\": \"Winfried Kretschmann is the only Green Minister-President and a very important figure of the Realo-wing. If we want to win this thing, we’ll have to reach out towards the center, and he knows how. Let’s ask him to appear with us across South Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"It’s important that all wings of our party stay united and motivated to vote. Let’s campaign with Friedrich Merz to show that I’m taking people like him and his positions seriously - the Greens have a clear profile, and I’m proud to stand with him for our values!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"Okay, hear me out. This campaign needs a wildcard. This whole time, the Greens are always portrayed as “woke” or something. We could really turn some heads if we show that we’re serious about my pivot on refugees, and there’s only one person in our party who could do that: Boris Palmer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 743, \"description\": \"I trust the German people to choose the most competent candidate and party. I believe this campaign is won on the issues, and as such, I want to be optimistic and future-oriented, instead of divisive.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 743, \"description\": \"The Green Party has always been in favor of more transparency. We need a ban on lobbying for money and a mandatory lobby register by law where all side earnings and -activities are publicized in full! We also need stricter rules for MP’s with regard to stock trading.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"Yes, I need to press the attack. Looking at the extent of this affair it’s obvious that there is a structural and systemic problem in the CDU/CSU. For decades it seems to be a custom for their MP’s to earn plenty of income through their mandate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"We need to take Olaf Scholz down a notch. Both as mayor of Hamburg and as Finance Minister, he has been involved in shady dealings around the Warburg Bank’s cum-ex trading and the Wirecard affair. He’s saying he “can’t remember”! We have to ask questions about his own personal integrity if he’s unwilling to explain himself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 744, \"description\": \"I don’t have anything to lose here, so let’s lean into this. I’ve studied Political Science and International Law - what else could have prepared me better for the position of German chancellor?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 744, \"description\": \"While I might not have the practical experience, I am a working mother of two elementary school children. I want to emphasize that part of my biography more, so people will see me as more approachable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 744, \"description\": \"This is a problem all parties in the Bundestag struggle with - there are many more people with a college degree than without in our parliament. We all have to work together to change this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4107, \"fields\": {\"question\": 744, \"description\": \"I reject the notion that you must have personally experienced something to find the right answers. The point of representative democracy is to choose politicians to represent the people, they don’t have to be like them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4108, \"fields\": {\"question\": 745, \"description\": \"I’ve made some mistakes, yes, but these accusations from some conservative blogger are unfair and completely blown out of proportion. I will get a media lawyer to fight back- this comes close to character-assassination.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4109, \"fields\": {\"question\": 745, \"description\": \"It was a mistake to publish the book in its current state and I apologize for this lapse in judgment. My intention was not to deceive anyone, I simply quoted widely available facts, and as this isn’t a scientific paper, I didn’t think a bibliography was necessary. Now, we should keep talking about the issues that matter most.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4110, \"fields\": {\"question\": 745, \"description\": \"This book hasn’t been written by just me, I had a co-author. I’ll make it clear that most of the problematic parts were his responsibility and I didn’t have much to do with them - although I should’ve vetted him a bit better..\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4111, \"fields\": {\"question\": 745, \"description\": \"What a double standard. This is a popular non-fiction book, not a scientific article. Let’s point to Armin Laschet - in his 2009 book, there are several plagiarized passages, and they’re finding more and more. Why aren’t they talking about that?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4112, \"fields\": {\"question\": 746, \"description\": \"I want to promote the book on every rally and give out copies at a discounted price. We need to return to broader visions in politics, and I’m hoping people can follow mine if I’ll make it more available to my voters.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4113, \"fields\": {\"question\": 746, \"description\": \"I want to point towards the book as a serious contribution to the most important policy debate this country has right now. I’ll send copies to journalists and intellectuals so they can review the book - a good bout of media coverage is what we need right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4114, \"fields\": {\"question\": 746, \"description\": \"Showing it off like this could hurt my image as being sensationalist or something. I’ll announce that it has been published, but I more so want it to serve in the background as a referral if anyone is further interested in how I’m thinking.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4115, \"fields\": {\"question\": 747, \"description\": \"If everyone has gotten an offer for a vaccine, we shouldn’t rule out that vaccinated people might be able to do more than the unvaccinated. It can’t be that the freedoms of everyone are getting restricted because some don’t want to get the shot.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4116, \"fields\": {\"question\": 747, \"description\": \"We are doing a lot to get everyone vaccinated right now without thinking about the consequences. What if the vaccine is toxic? We shouldn’t underestimate alternative medicine, and we should support people’s freedom to choose homeopathic medicine instead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4117, \"fields\": {\"question\": 747, \"description\": \"Mandatory vaccinations aren’t easy to implement - but we have to think of the alternatives. If our children have to undergo further lockdowns, we will need a general vaccine mandate in Germany, to protect them and those who did everything they could to uphold our medical system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4118, \"fields\": {\"question\": 747, \"description\": \"Overall, we are on the right path with the vaccination campaign. We need to do more to reach everyone though, including mobile vaccination teams that can provide coverage to areas with low vaccination rates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4119, \"fields\": {\"question\": 748, \"description\": \"With the Social Democrats demotivated as they are, we can set our sights onto Laschet. I’m gonna emphasize how we need change in our government aswell as show off our commitment to lead a sensible government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4120, \"fields\": {\"question\": 748, \"description\": \"It’s a good sign for us that the SPD is down in polls - but they’re still a formidable voting block. Their voters should be easiest to win over - let’s target them specifically by emphasizing our socio-economic program and consolidate the center-left around us.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4121, \"fields\": {\"question\": 748, \"description\": \"It looks like Die Linke might struggle to reach the 5%-hurdle. I am clearly the best option for a leftist government - by pressing on this issue, we could keep them out of government and simplify finding a majority. Maybe it’ll even be enough for Green-Red!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4122, \"fields\": {\"question\": 748, \"description\": \"They might be a bit weaker than they were four years ago, but the amount of votes the AfD is projected to receive is still way too high. It should be every democratic party’s duty to keep the nationalists out of parliament. Let’s show off their misgivings.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4123, \"fields\": {\"question\": 749, \"description\": \"Mr. Laschet’s crisis responses are erratic and unreliable. He can not hold a clear line on Covid, he can not stand up to pressure and corruption from his own party, and his response to the disastrous floods this summer shows that he lacks the temperament to be a good chancellor. Germany deserves someone better than him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4124, \"fields\": {\"question\": 749, \"description\": \"How convenient that the Union pivots to social policies only when we’re talking about fighting climate change. Mr. Laschet has to realize that the Paris agreement isn’t voluntary! He does not provide any new concepts on climate action, he’s just always “against”. This attitude is hurting Germany’s industrial future!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4125, \"fields\": {\"question\": 749, \"description\": \"For the last 16 years, this country has been governed by the CDU/CSU, and they are out of ideas on what to do in government. Armin Laschet is the candidate of standstill politics: he is against more investments and against the duly needed modernization of Germany. When we look at the unchanged problems in our country - I think it’s time for change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4126, \"fields\": {\"question\": 749, \"description\": \"Actually, I’ve changed my mind. The mudslinging isn’t worth it - after giving my usual critiques of both candidates, I’ll just wing it and rely on my instincts as a progressive to rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4127, \"fields\": {\"question\": 750, \"description\": \"The CDU/CSU has been in government for 16 years, the SPD for 8. There are only two options - will we duck behind the continuity of the Grand Coalition of CDU and SPD, or will we accomplish real change?  We are far behind on many issues - it’s time for a Green chancellorship!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4128, \"fields\": {\"question\": 750, \"description\": \"There is one issue that really matters in this election: Climate change! I’m the only one to have a program that’s ambitious enough to truly make a difference. I will not keep making half-measures on climate action like the Grand Coalition: the next government has to be a climate-government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4129, \"fields\": {\"question\": 750, \"description\": \"I’d like to focus on our social policies. It’s not the fault of climate action that people get paid too little, that the minimum wage is too low and that every fifth child lives in poverty. That’s because of policies that intend to mainly relieve high-earners and which do not look at poverty in Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4130, \"fields\": {\"question\": 750, \"description\": \"Actually, screw this! I know they won’t hold back, so I won’t either. These old white men need someone to tell them how it is. Years and years of standstill, and these just won’t admit that we need change. Someone has to stand up and fight!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4131, \"fields\": {\"question\": 750, \"description\": \"This is simply not as much of a big deal as people make of it. I don’t even get an income as party chair. These payments, while I should’ve reported them, are small peanuts, and the parliament hasn’t even asked me to report them, I did that on my own initiative. Frankly, these criticisms smell like sexism!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4132, \"fields\": {\"question\": 750, \"description\": \"Not only that, I want to show off the plethora of ideas that The Greens are putting up. Robert wrote a phenomenal book called “Von hier an anders: Eine politische Skizze”, and I want him to show his work off prominently as well.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4535, \"fields\": {\"question\": 809, \"description\": \"I stand by my course: 2011, 2018 and 2019 showed us how Germany is fed up with the excuses on climate change. On this issue, our politics has lost all links to reality, because it’s not radical enough. We can not decide against all the knowledge and all the facts about climate change, we need to do something!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4536, \"fields\": {\"question\": 809, \"description\": \"Stateliness and radicalism aren’t opposites! To really change something, we can’t just swallow the unshackling of global capitalism. We decided on taxing the rich as a party, but we’d be crazy if we didn’t think on a grander scale: instead of arguing about the instruments, we need to ask some critical questions about our economic system!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4537, \"fields\": {\"question\": 809, \"description\": \"Look, I get it. We need to win societal and parliamentary majorities, so that our country becomes more just. If that means tampering our rhetoric a bit, so be it. It is our job to provide a good offer for the progressive-left center of this country, and while that includes classically leftist answers, it also goes beyond them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4538, \"fields\": {\"question\": 810, \"description\": \"Ideology isn’t that important to me. I want to answer questions on important issues: what about older people in rural areas, what about the education system, the origins of poverty? We need to listen to different people; environmental protection, social justice and economic prosperity don’t contradict themselves. As a modern party, let us cast a broad net.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4539, \"fields\": {\"question\": 810, \"description\": \"Look, ecological goals don’t just have to be ambitious, they have to be reachable, and affordable. We need to leave the image of a “prohibitory party” behind us - frankly, we have failed in the past with tax-raising-debates - instead we should support sensible, workable policies. Work from within the system - sticking to dogma doesn’t get us anywhere.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4540, \"fields\": {\"question\": 810, \"description\": \"I wanted to broaden our appeal by showing how we’re open to all of society, open to other arguments. That said, our party needs a strongly defined profile, I agree. In the coming campaign, we should increasingly emphasize our environmentalism and center-left attitude.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4133, \"fields\": {\"question\": 751, \"description\": \"Robert Habeck is currently on a pretty popular tour across the North Sea coast. Let’s join him to show the unity of our party and produce some great pictures of us as the ‘dynamic duo’!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4134, \"fields\": {\"question\": 752, \"description\": \"If there is one Green name that’s as important as mine these days it’s “Robert Habeck”. Despite our minor issues, Robert was always a loyal compatriot. We are the faces of our party, and with his outstanding people-skills, I want to rally with him to show what the Greens have to offer, all across Northern Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4541, \"fields\": {\"question\": 811, \"description\": \"This is unbelievable. These rumors are pure sexism, and I will meet the demands head-on. I’m going to make a statement that replacing the only woman in this race will be an affront to all German girls and women deserving of representation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4542, \"fields\": {\"question\": 811, \"description\": \"I won’t even address these concerns. They are of no serious importance. I’ll just let my party dispel these rumors and keep campaigning like normal.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4543, \"fields\": {\"question\": 811, \"description\": \"I have to take this seriously. I will change some staff around and amend my rhetoric, I will be out there with full passion, making myself more visible. Maybe we can give a few likable interviews in my home, showing off my hard work as a mother.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4544, \"fields\": {\"question\": 811, \"description\": \"They’re not ready. I have to admit it - I really want to lead this country into a new age, but without the right numbers, it won’t be possible. These annoying inconveniences won’t tamper with our momentum anymore. Robert, it seems this is your time after all: take it away.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4545, \"fields\": {\"question\": 812, \"description\": \"This is unbelievable. These rumors are pure sexism, and I will meet the demands head-on. I’m going to make a statement that replacing the only woman in this race will be an affront to all German girls and women deserving of representation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4546, \"fields\": {\"question\": 812, \"description\": \"I won’t even address these concerns. They are of no serious importance. I’ll just let my party dispel these rumors and keep campaigning like normal.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4547, \"fields\": {\"question\": 812, \"description\": \"I have to take this seriously. I will change some staff around and amend my rhetoric, I will be out there with full passion, making myself more visible. Maybe we can give a few likable interviews in my home, showing off my hard work as a mother.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4548, \"fields\": {\"question\": 812, \"description\": \"They’re not ready. I have to admit it - I really want to lead this country into a new age, but without the right numbers, it won’t be possible. These annoying inconveniences won’t tamper with our momentum anymore. Robert, it seems this is your time after all: take it away.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4549, \"fields\": {\"question\": 813, \"description\": \"This is unbelievable. These rumors are pure sexism, and I will meet the demands head-on. I’m going to make a statement that replacing the only woman in this race will be an affront to all German girls and women deserving of representation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4550, \"fields\": {\"question\": 813, \"description\": \"I won’t even address these concerns. They are of no serious importance. I’ll just let my party dispel these rumors and keep campaigning like normal.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4551, \"fields\": {\"question\": 813, \"description\": \"I have to take this seriously. I will change some staff around and amend my rhetoric, I will be out there with full passion, making myself more visible. Maybe we can give a few likable interviews in my home, showing off my hard work as a mother.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4552, \"fields\": {\"question\": 813, \"description\": \"They’re not ready. I have to admit it - I really want to lead this country into a new age, but without the right numbers, it won’t be possible. These annoying inconveniences won’t tamper with our momentum anymore. Robert, it seems this is your time after all: take it away.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4553, \"fields\": {\"question\": 814, \"description\": \"Future doesn’t just happen - it’s created. By courageous people who grow beyond themselves, every day.\"}}]");
