campaignTrail_temp.answer_feedback_json = JSON.parse("[{\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5500, \"fields\": {\"answer\": 4500, \"candidate\": 79, \"answer_feedback\": \"In the post 2015-discourse, while every other party seems divided over where society is headed, you provide for a clear contrast and a loud voice for progressives all over the country. Of course, this puts you in a direct confrontation with those who feel alienated by the political leftwards turn, particularly the AfD.<br>Unfortunately though, Covid soon hits the country, changing the narrative once again…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5501, \"fields\": {\"answer\": 4501, \"candidate\": 79, \"answer_feedback\": \"The youth seems as politically active as they haven't been in years. Famous Youtuber Rezo even produces a viral video in 2019, chastising the government's climate policies. You are the ‘party of the environment’ and this is your core constituency - your activation of young voters displays strength and garners momentum, even among some parents. <br>Unfortunately though, Covid soon hits the country, changing the narrative once again…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5502, \"fields\": {\"answer\": 4502, \"candidate\": 79, \"answer_feedback\": \"The „Good Old“ SPD certainly seems to be on its last legs these days. It's been a downward spiral ever since Schröder lost to Merkel – and in between neoliberalism and three GroKo's, they've seemingly lost so much of their profile that The Greens seem like a good option to many of their former voters nowadays.<br>Unfortunately though, Covid soon hits the country, changing the narrative once again…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5503, \"fields\": {\"answer\": 4503, \"candidate\": 79, \"answer_feedback\": \"You and Robert Habeck are a young, dynamic duo, popular in your appearances, drawing a nice contrast to the old, unpopular politicians of the establishment. While you're avoiding more specific lines, people start to perceive The Greens as an actual opportunity for change.<br>Unfortunately though, Covid soon hits the country, changing the narrative once again…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5000, \"fields\": {\"answer\": 4000, \"candidate\": 79, \"answer_feedback\": \"With great vigor, you continue to work on your book, and indeed, you find some passages that might need clarifications and sources. While you’re enveloped by your writing, you seem invisible to the voters; but maybe, once the book releases, it can produce some good media coverage.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5001, \"fields\": {\"answer\": 4001, \"candidate\": 79, \"answer_feedback\": \"There’s not much to do for you - you fix up some minor irregularities in your CV and report some small earnings that you almost forgot about to the parliament. That said, your thorough self-background-check is taking up a lot of time that could’ve been spent appealing to voters - here’s hoping your integrity will stand out.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5002, \"fields\": {\"answer\": 4002, \"candidate\": 79, \"answer_feedback\": \"You were called “talk show queen” in 2019, and with your repeated visits to talk shows like “<i>Hart aber fair</i>” and “<i>Maischberger</i>”, the media chatters wildly about your ambitions. Both your name recognition and your favorability numbers improve in the coming weeks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5003, \"fields\": {\"answer\": 4003, \"candidate\": 79, \"answer_feedback\": \"Luisa Neubauer, main coordinator of FFF Germany, is indeed a Green party member, but she’s not a diehard loyalist: even your party has been criticized by Fridays for Future for not being ambitious enough. Still: your efforts effectively mobilize the youth vote and pad out your floor in polling.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5004, \"fields\": {\"answer\": 4004, \"candidate\": 79, \"answer_feedback\": \"Certainly admirable. The German people are happy, and you don’t attract negative headlines while building bridges with the government parties. You aren’t really blunting the CDU’s momentum, but maybe that can wait until election season.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5005, \"fields\": {\"answer\": 4005, \"candidate\": 79, \"answer_feedback\": \"If you want to stand out in attacking the government, this is a good way to go about it. As a parent of young children yourself, these remarks come off as authentic: many feel that the needs of their kids have not been adequately met. Also, many young students might be first-time-voters for you, come election season.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5006, \"fields\": {\"answer\": 4006, \"candidate\": 79, \"answer_feedback\": \"Although many restrictions are unpopular, most experts agree that they are necessary right now. Your party doesn’t seem to agree on a clear stance - some say, you’re doing opposition for opposition's sake. That said, you continue to foster an unlikely friendship with the FDP - a relationship that might become useful after the next election…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5007, \"fields\": {\"answer\": 4007, \"candidate\": 79, \"answer_feedback\": \"An attempt at Agenda-Setting? Of course, when the conversation revolves around the climate, your party is perceived as competent - but with the ubiquity of Covid in people’s lives, your statement doesn’t really hit the spot. At least you’ve riled up the climate skeptics…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5008, \"fields\": {\"answer\": 4008, \"candidate\": 79, \"answer_feedback\": \"The media is surprised that you’re the Green candidate, but your vague, broad appeal is decently received. Many have been speculating if The Greens are the next ‘Volkspartei’ - this speech seems to seal the deal. With both CDU and SPD struggling in the polls, you might be able to win a generic popularity contest, if you can outshine the other candidates with your pitch: “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5009, \"fields\": {\"answer\": 4009, \"candidate\": 79, \"answer_feedback\": \"Although most thought Habeck would win out, your party is as fired up as ever by your spirited defense of the party’s main identity. Is it enough to win? With the CDU and SPD both struggling in the polls, an energized campaign might very well be worth a try. “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5010, \"fields\": {\"answer\": 4010, \"candidate\": 79, \"answer_feedback\": \"Although many doubted you to really become chancellor candidate, your appeal to a renewed politics works wonders, and with the CDU and SPD both struggling in the polls right now, you might be able to deliver in the fall. Many voters now have high hopes for you as the next generation of leadership. Your motto says as much: “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5011, \"fields\": {\"answer\": 4011, \"candidate\": 79, \"answer_feedback\": \"In a double-surprise, not only are you announced to be chancellor candidate, your speech is also perceived as quite centrist. You seem to gamble that the Fundis-wing of the Party is truly dead, evoking Winfried Kretschmann’s attitude. As both the CDU and SPD are struggling, there might be an opening for you with their voters - but be mindful of your base. They’re only “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5012, \"fields\": {\"answer\": 4012, \"candidate\": 79, \"answer_feedback\": \"Your traditional base has seemingly expanded, ever since the SPD collapsed into the sub-twenties. Some pundits wonder though, if hitting downwards is the right way to capitalize on the Greens' newfound polling highs. Defending your second place seems a bit cautious, and leftist infighting might be beneficial to critics from your right.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5013, \"fields\": {\"answer\": 4013, \"candidate\": 79, \"answer_feedback\": \"The core base of the CDU might be impossible to crack, and attacks from your left follow swiftly due to your pivots. However, there's not much enthusiasm around Laschet, and he’s a vulnerable target - presenting yourself as a viable alternative to swing voters might be the way to go.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5014, \"fields\": {\"answer\": 4014, \"candidate\": 79, \"answer_feedback\": \"Your turnout-focused strategy might get more first-time voters to the polls, but this might not be enough to expand into first place. The electorate skews older in almost every election, and your core base only netted you around 8.9% last time - the sheer number of old people in Germany might just be too large. Meanwhile, Rezo declines to actually endorse anyone publicly, although he does publish another video attacking the Unions Covid-policies.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5015, \"fields\": {\"answer\": 4015, \"candidate\": 79, \"answer_feedback\": \"Until now, the Green Party message really didn't seem to resonate with East Germany - instead, the party is mostly confined to the cities, being seen as “elitist”. The region is known for low turnout in general though - maybe you can get some of those people to go out and vote Green this time?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5016, \"fields\": {\"answer\": 4016, \"candidate\": 79, \"answer_feedback\": \"Foreign policy is not a big deal in this election, but the CDU of course continues to needle you. There is concern about the state of the Bundeswehr, although your answer has appeal to those weary of warmongering and the broader center-left, without being too aggravating. The fiscal wiggle room later on might also be worth it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5017, \"fields\": {\"answer\": 4017, \"candidate\": 79, \"answer_feedback\": \"The Greens really have changed - this positions you as arguably more hawkish than your opponents. Your steadfast position is appreciated by human rights activists and lands well with the electorate, but several experts are alarmed about the stability of the energy supply and the benefits of Free Trade. Let's hope this position will be vindicated come September.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5018, \"fields\": {\"answer\": 4018, \"candidate\": 79, \"answer_feedback\": \"30 years ago, this would have been a mainstream position within your party - now, it’s on the fringe, and a worldview too simplistic for the median voter. The SPD smells weakness and needles you on your stance towards NATO - are The Greens not ready for leadership after all, or do you believe in a silent majority?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5019, \"fields\": {\"answer\": 4019, \"candidate\": 79, \"answer_feedback\": \"The word “feminism” or course immediately rings the right-wing alarm bells, and they sure are letting you know on social media. Although several academics and party activists applaud you, your wonky rhetoric doesn’t really stick the landing with the average voter. Leave the IR-theories for after the election!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5504, \"fields\": {\"answer\": 4504, \"candidate\": 79, \"answer_feedback\": \"European cooperation is your strong suit, and your answer is positively noted by some formerly skeptical pundits - but this still leaves a weird conservative aftertaste in the mouth of your supporters. Normally, the Greens are quite multiculturalist; now, the SPD might actually outflank you on this issue, if you can believe it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5505, \"fields\": {\"answer\": 4505, \"candidate\": 79, \"answer_feedback\": \"While many expected you to focus on humanitarianism, your embrace of qualified immigration is well received by pragmatists. A few activists want you to go further - they are uncomfortable with you ranking immigrants on their economic potential, and smell an unwanted pivot on refugees.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5506, \"fields\": {\"answer\": 4506, \"candidate\": 79, \"answer_feedback\": \"A strong principled stance that follows progressive doctrine. You’re probably the party best-positioned to represent the cultural left on this issue. You can use that to your advantage, as long as you don’t let right wing trolls get under your skin.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5507, \"fields\": {\"answer\": 4507, \"candidate\": 79, \"answer_feedback\": \"Wh-what? Did you have an eye-opening talk with Boris Palmer? Journalists speculate that this was an attempt at a joke. Your party is shocked beyond belief and forces you to apologize the next day - but the damage is already done. The AfD feels humorously satisfied at you vindicating them, as your support plummets in favor of Scholz and other progressives.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5020, \"fields\": {\"answer\": 4020, \"candidate\": 79, \"answer_feedback\": \"This is a valid critique that is shared by many experts - the Climate Protection Act certainly has ambitious goals, but lacks a concrete path to get there. Your party is the leading voice on environmentalism to the public, and this focus on action is certain to strengthen that view.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5021, \"fields\": {\"answer\": 4021, \"candidate\": 79, \"answer_feedback\": \"You’re emphasizing consensus here, hoping for a quick resolution - although the government parties still don’t involve your ideas in their new draft, you’ve shown your goodwill and ability to compromise to centrist voters. But are compromises really what the Germans want in this day and age?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5022, \"fields\": {\"answer\": 4022, \"candidate\": 79, \"answer_feedback\": \"The Greens clearly feel vindicated after this decision. Just don’t squander your newfound goodwill here - the Germans want a concrete plan. Putting the spotlight on changing the status quo keeps their favorability low, but your appeal stays vague and unfocused.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5023, \"fields\": {\"answer\": 4023, \"candidate\": 79, \"answer_feedback\": \"Your focus on Europe is viewed favorably by pragmatists, although the “Green New Deal” quickly becomes a favorite buzzword among the Right. Some activists seem disappointed about your vague stance and are suspicious of what seems like mere lip service - they want more concrete leadership in Germany.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5024, \"fields\": {\"answer\": 4024, \"candidate\": 79, \"answer_feedback\": \"Robert is a natural at stamping through the mud flats of Sylt, in talking to pensioners on the coast or farmers in the inlands of his home. However, it becomes clear, he feels a bit sidelined -  and lets the media subtly know, through some snide remarks. There is speculation that you’re scared of his popularity, and don’t want to feel upstaged.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5025, \"fields\": {\"answer\": 4025, \"candidate\": 79, \"answer_feedback\": \"Robert is happy to cooperate with you, and his popularity does wonders for you. There are talks of him becoming Minister of Finances after the election - although in between those, there’s the occasional whisper around why he isn't the chancellor candidate. But those are undoubtedly just of a sexist nature - either way, your harmony is regarded well.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5026, \"fields\": {\"answer\": 4026, \"candidate\": 79, \"answer_feedback\": \"Robert is pretty good at explaining your policies - his “no-bullshit-attitude” goes over well with potential voters. Perhaps a bit too well - with your vagueness, people are wondering why you are the candidate instead of him. Even some internal cadres complain about your invisibility, and your personal numbers experience a small drop.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5027, \"fields\": {\"answer\": 4027, \"candidate\": 79, \"answer_feedback\": \"Good thinking, but Roberts personality is just not suited for that task. He tries to go on the attack a lot, but he often comes across as bizarre and frustrated. He seems stressed and vicious - his popularity sinks, while your opponents seem mostly unfazed. This might hurt more than it helps.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5028, \"fields\": {\"answer\": 4028, \"candidate\": 79, \"answer_feedback\": \"While this usually really wouldn’t be a big deal, and your supporters stand by you, it’s still a bad bout of media coverage for you. Maybe people are measuring with double standards due to your gender? Who knows, but you better be careful from now on…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5029, \"fields\": {\"answer\": 4029, \"candidate\": 79, \"answer_feedback\": \"This leads to accusations being thrown around between all three parties, dragging down everyone’s favorability numbers. This campaign suddenly got a lot more dirty - populists on both sides of the aisle salivate at the mudslinging, seeking to capitalize on the frustrations of the ordinary citizen.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5030, \"fields\": {\"answer\": 4030, \"candidate\": 79, \"answer_feedback\": \"Fair enough, but this seems a bit hypocritical in the wake of your scandal - a bad bout of media coverage for you. Maybe people are measuring with double standards due to your gender? Who knows, but you better be more careful from now on…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5031, \"fields\": {\"answer\": 4031, \"candidate\": 79, \"answer_feedback\": \"This might be helpful for the climate - but with gas prices at an all-time high already, this topic is what keeps the Greens weak in rural regions and among some swing voters. Laschet immediately jumps on your comments - it might be best to move on to something more advantageous.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5032, \"fields\": {\"answer\": 4032, \"candidate\": 79, \"answer_feedback\": \"At least you are trying to hedge the issue and be mindful of the impacts of a higher price, but there are still people wondering about your vagueness on concrete numbers.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5033, \"fields\": {\"answer\": 4033, \"candidate\": 79, \"answer_feedback\": \"Everyone but the most ardent environmentalists is deeply alarmed by this statement - they fear they wouldn’t be able to afford a car anymore. Rural voters are especially skeptical towards this stance - after all, buses aren’t popular, and the train network is… well… administered by the Deutsche Bahn.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5034, \"fields\": {\"answer\": 4034, \"candidate\": 79, \"answer_feedback\": \"The interviewer is (perhaps positively) surprised - your clear pivot is noted by the media. Fridays For Future calls for its supporters to vote for special “Climate Lists”, instead of you. This will hurt your momentum with young voters - here's hoping you can make inroads among groups that turn out more reliably.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5035, \"fields\": {\"answer\": 4035, \"candidate\": 79, \"answer_feedback\": \"Your answer echoes the most immediate concerns that left-wingers have with Hartz IV, though still being palpable for moderates. Many are dissatisfied with the current system, and winning brownie-points among your base is a good way of keeping everyone content. Hopefully your policies will prove effective.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5036, \"fields\": {\"answer\": 4036, \"candidate\": 79, \"answer_feedback\": \"With your staunchly leftwing a position, you siphon over some Left voters and poorer people. Your strong stance isn’t exactly out of character, but it frightens some fiscal moderate Realos, while conservatives attack you for wanting unchecked government handouts.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5037, \"fields\": {\"answer\": 4037, \"candidate\": 79, \"answer_feedback\": \"There have been numerous discussions about this idea in your party. The state-provided minimum income appeals to ardent left-wingers, while the promises of bureaucracy reform might even be appealing to some eccentric fiscal conservatives. On the whole though, experts doubt your math here - this idea is still on the fringe and not all that popular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5038, \"fields\": {\"answer\": 4038, \"candidate\": 79, \"answer_feedback\": \"Rhetoric like this is less leftist than voters are used to from you. Some moderates might like this, although a lot of Fundis as well as the Green Youth seem irritated at best. You could broaden your base like this: it was your party after all, who participated in the introduction of Hartz IV under Gerhard Schröder.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5508, \"fields\": {\"answer\": 4508, \"candidate\": 79, \"answer_feedback\": \"Climate change is what catapulted you into your pole position in the first place - it’s not a bad thing to frame this election around your strongest issue. You are expected to branch out a bit though, The Greens have often been criticized as a “one-issue-party”- if you can show off some real leadership, maybe that can change.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5509, \"fields\": {\"answer\": 4509, \"candidate\": 79, \"answer_feedback\": \"Germans certainly haven’t been too keen on egregious mudslinging in the past. Your principled stance gains some early praise - but if you want to keep this up, you can’t let the campaign get derailed by character-issues, or else you’ll seem tone-deaf. Hopefully, everything around your person is in good order.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5510, \"fields\": {\"answer\": 4510, \"candidate\": 79, \"answer_feedback\": \"You’re shooting for The Greens to become a sustainable ‘Volkspartei’, it seems. Your rightwards pivot gains mixed reactions, but you did open the door to older generations and even curious Union-voters. This might pay off in the long run, if you can keep up the momentum as Laschet’s alternative.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5039, \"fields\": {\"answer\": 4039, \"candidate\": 79, \"answer_feedback\": \"Unfortunately, the media does not move on - instead, they needle you on further inconsistencies that still have to be fixed. First the earnings, now this - the public starts to reconsider its view of you. You come off as sloppy, incompetent even: this image is something you will have to combat, if you want to stay competitive.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5040, \"fields\": {\"answer\": 4040, \"candidate\": 79, \"answer_feedback\": \"A harsh allegation, although some supporters and leftwing op-eds concur. Overall though, the average voter disagrees with your characterization and starts to seriously doubt your competency. Whatever the reason, your likeability takes a hit, and the narratives derails from the topics you’re popular in, to these unfortunate occurrences.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5041, \"fields\": {\"answer\": 4041, \"candidate\": 79, \"answer_feedback\": \"You realize that things like the Wayback machine exist, right? Your CV has been edited multiple times in the last few days. This answer makes you look disingenuous - a small issue about your competency has turned into concerns of your integrity, and your opponents call you out on it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5042, \"fields\": {\"answer\": 4042, \"candidate\": 79, \"answer_feedback\": \"Your answer seems honest and down-to-earth. Your easy-going approach even earns you laughs and applause at your convention, but the chatter around your misgivings still makes a lot of people doubt your competence for now.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5043, \"fields\": {\"answer\": 4043, \"candidate\": 79, \"answer_feedback\": \"It’s good to press the attack here - you were part of the opposition in the last decade and can credibly offer change. Particularly rural people are tired of their slow connections and a sluggish bureaucracy around the advancement of fiber-optic infrastructure. Young voters of course appreciate your focus on modern topics.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5044, \"fields\": {\"answer\": 4044, \"candidate\": 79, \"answer_feedback\": \"Many people are wondering why you’re focussing on AI - it doesn’t really register as a big topic in 2021. While experts praise your ambition, most simply do not care about your lofty rhetoric. That said, maybe being prepared here could pay off in the future.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5045, \"fields\": {\"answer\": 4045, \"candidate\": 79, \"answer_feedback\": \"These are some innovative solutions - improving Germany’s famously sluggish bureaucracy is quite popular. However, most parties are calling for some action on this front - your framing does not make you stand out. The FDP meanwhile drives their strategy on this issue in particular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5046, \"fields\": {\"answer\": 4046, \"candidate\": 79, \"answer_feedback\": \"Although your heart might be in the right place, the Snowden affair was 12 years ago, and is not a particularly important topic in this election. Germans are a bit wary of American companies, but since data protection seems to be a boring topic, most don’t listen to your promises.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5047, \"fields\": {\"answer\": 4047, \"candidate\": 79, \"answer_feedback\": \"You’ve stuck to your principles here and strengthened your profile on climate change. A clear and concrete stance is a good thing, although this is divisive - the FDP in particular attacks you sharply. Public opinion seemingly favors you, hopefully this gets reflected at the ballot box.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5048, \"fields\": {\"answer\": 4048, \"candidate\": 79, \"answer_feedback\": \"The data on this isn’t really conclusive, but your point seems solid to those more critical of the climate argument. While climate change is your defining topic, framing your popular policies like this can help build appeal beyond your base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5049, \"fields\": {\"answer\": 4049, \"candidate\": 79, \"answer_feedback\": \"This echoes the sentiment of some Realos like Winfried Kretschmann - however your base seems quite deflated by this, and with the SPD and Left party still advocating for a general tempo limit, you seem spineless in the face of conservative critics.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5050, \"fields\": {\"answer\": 4050, \"candidate\": 79, \"answer_feedback\": \"While public opinion seems to be shifting in favor of a 130 km/h tempo limit, the 30 km/h within city limits is still unpopular, especially in the east. While this probably would be helpful for hitting Germany’s emission targets, a hard line like this reinforces The Greens as a predominantly urban party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5511, \"fields\": {\"answer\": 4511, \"candidate\": 79, \"answer_feedback\": \"This is a surprisingly conservative answer that disappoints many in your camp. You have criticized the government on its unambitious plans several times, so why not go further here? Younger voters are alienated by your statements, and environmentalists are worried about too permissive building policies.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5512, \"fields\": {\"answer\": 4512, \"candidate\": 79, \"answer_feedback\": \"You are firmly placed on the left side of the culture wars, but progressive voters interested in your campaign agree with such measures. Of course, the right side of the aisle immediately shoots back with the usual critiques of multiculturalism. You've also avoided talking about government intervention, which might make talks with the FDP easier.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5513, \"fields\": {\"answer\": 4513, \"candidate\": 79, \"answer_feedback\": \"An expected answer that broadly pleases the left-of-center. While there are always those who stress about fiscal responsibility, this is a strong answer that shows engagement with this topic and provides some popular policies. Older voters usually aren't that Green-inclined, but maybe you can persuade some curious grandparents.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5514, \"fields\": {\"answer\": 4514, \"candidate\": 79, \"answer_feedback\": \"Pundits detect a pivot to the center, for better or worse. You don't incur a lot of direct criticism, and actually get the attention of some liberals – but your base is confused about how exactly you want to safeguard the social safety net. Your youth wing actually dares to openly question why you’re not going further.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5051, \"fields\": {\"answer\": 4051, \"candidate\": 79, \"answer_feedback\": \"Your media lawyer Christian Schertz reasserts your claims, and provides you with a spirited defense. Most experts see you in the right and your party comes to your aid, but the kerfuffle keeps the story in the news cycle. Once again, the race seems to revolve around your misgivings.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5052, \"fields\": {\"answer\": 4052, \"candidate\": 79, \"answer_feedback\": \"On its own, this apology might have helped you - but after the earlier discourse around your scandals, more and more people seem to doubt your judgment. You simply come off as careless. A lot of voters seem to give the SPD a second look nowadays, it seems…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5053, \"fields\": {\"answer\": 4053, \"candidate\": 79, \"answer_feedback\": \"Ouch, Annalena! It’s still your name on the cover of the book. Throwing Michael under the bus like this is pretty spiteful, and behind the scenes, even your colleagues ask you to tone it down. Publicly, the story picks up steam, with people seeing through the deflections - your favorability keeps tanking, and Olaf Scholz seems pretty sensible in contrast to you…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5054, \"fields\": {\"answer\": 4054, \"candidate\": 79, \"answer_feedback\": \"While these are clearly deflections, you aren’t alone in the spotlight anymore, as more and more plagiarized passages of his are found. You took the bull by the horns, and in doing so, dragged the race into the mud - laughing at the sidelines stands Olaf Scholz, with a smurfy grin on his face.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5515, \"fields\": {\"answer\": 4515, \"candidate\": 79, \"answer_feedback\": \"It seems you really want to commit to making the Greens a ‘Volkspartei’ - such a promise resonates with rural areas, but your base wants to see more action to directly improve the situation by intervening in the market. There are also significant environmental concerns about using more land to build small family homes - not a good look for your profile.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5516, \"fields\": {\"answer\": 4516, \"candidate\": 79, \"answer_feedback\": \"This is a classic Realo-like plan to deal with the crisis - although environmentalists are worried that building more might be hurtful to Germany’s ecosystem. To the left’s dismay, you avoid the topic of rent controls, but given similar plans in Berlin were ruled unconstitutional, no one can blame you. ‘Do no harm.’\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5517, \"fields\": {\"answer\": 4517, \"candidate\": 79, \"answer_feedback\": \"Your party base loves this - the Greens are predominantly urban after all. This should reinforce youth turnout, which can only be good for you. Keep in mind though that a similar plan by your state party in Berlin has been ruled unconstitutional recently, so tread lightly if you actually want to deliver.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5518, \"fields\": {\"answer\": 4518, \"candidate\": 79, \"answer_feedback\": \"While some Fundis and the Green Youth appreciate your anti-capitalist pivot, everyone else does not. Many unideological voters looked to the Greens as an interesting new option, transformed from their socialist student-movement past - now they feel like you’ve proven them wrong.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5055, \"fields\": {\"answer\": 4055, \"candidate\": 79, \"answer_feedback\": \"You opt to enjoy your holiday instead - and the press takes note. While your statements are generic enough, your advisors are irritated, as your cold invisibility leaves a bitter taste in the mouth of most voters. However, Laschet gaffes himself - he gets caught boyishly laughing in a press conference with President Steinmeier. Laschet’s Lacher might’ve just saved you from further embarrassment.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5056, \"fields\": {\"answer\": 4056, \"candidate\": 79, \"answer_feedback\": \"Your humbleness seems appropriate and keeps you out of negative headlines - but as a chancellor candidate, you seem quite invisible these days. But maybe that will pay off:\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5057, \"fields\": {\"answer\": 4057, \"candidate\": 79, \"answer_feedback\": \"Your visits seem appropriate and stately. You get some good pictures in an uncontroversial press coverage, and the locals appreciate your concern.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5058, \"fields\": {\"answer\": 4058, \"candidate\": 79, \"answer_feedback\": \"Robert Habeck is relatable, he’s photogenic, he’s empathetic. He nets some good press - but this just throws fuel on the fire of why you are the candidate, and not him.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5059, \"fields\": {\"answer\": 4059, \"candidate\": 79, \"answer_feedback\": \"Some accuse you of wanting to politicize this disaster, but overall, you have the credentials to come out guns blazing here. By siding with Söder, you divide your opposition and reframe the conversation around your preferred topic: climate change. Coal-producing regions of course won’t be happy, but maybe you don’t need those.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5060, \"fields\": {\"answer\": 4060, \"candidate\": 79, \"answer_feedback\": \"Some are happy about your lack of grandstanding, while others are irritated about how you won’t talk about climate change in the wake of this catastrophe. You avoid a big splash: perhaps, this can establish you as an independent thinker?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5061, \"fields\": {\"answer\": 4061, \"candidate\": 79, \"answer_feedback\": \"Polls show, your party has the most credibility on climate issues. Without boasting, the discussion refocuses around your area of expertise - not a bad turn of events. Showing off concrete measures here can improve perceptions of your leadership. Time for a surge?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5062, \"fields\": {\"answer\": 4062, \"candidate\": 79, \"answer_feedback\": \"A scathing attack, one that hits the spot. In the wake of this disaster, Laschet is certainly under a lot of heat about his crisis management and tone-deaf statements - keep the attention on his gaffes, and his numbers will surely deflate. Will a negative tone catapult you to the front?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5519, \"fields\": {\"answer\": 4519, \"candidate\": 79, \"answer_feedback\": \"You personally travel to the Saarland in support of Dillschneider. It takes some convincing to the delegates from Ulrich’s district Saarlouis, but in a narrow vote, a list with her at the top is approved and sent to the electoral commission. This whole ordeal took valuable time from your calendar, but you might have averted a crisis here.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5520, \"fields\": {\"answer\": 4520, \"candidate\": 79, \"answer_feedback\": \"You personally travel to the Saarland in support of Dillschneider. Unfortunately, the re-vote doesn’t change the result. While you have to get back to the campaign trail, in a confusing matter, two lists are submitted - both are rejected by the Electoral Commission. Now the Greens won’t be on the ballot in the Saarland, and your efforts were for naught.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5521, \"fields\": {\"answer\": 4521, \"candidate\": 79, \"answer_feedback\": \"The Green Party of the Saarland holds a re-vote, excluding several delegates from Ulrichs district Saarlouis, so Dillschneider wins. Unfortunately, the electoral commission rules this procedure undemocratic and rejects their list - this means The Greens won’t be on the ballot in the Saarland! Hopefully the difference is small enough to not matter.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5522, \"fields\": {\"answer\": 4522, \"candidate\": 79, \"answer_feedback\": \"This is a pragmatic move, and your intervention ends the argument with a change in the statues. However, giving up on The Greens’ long standing ideal of parity in their lists rankles many true believers, including Dillschneider, who retreats personally offended. The whole affair is sure to deflate enthusiasm, particularly in the Green Youth.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5063, \"fields\": {\"answer\": 4063, \"candidate\": 79, \"answer_feedback\": \"Your chemistry is as good as ever. You provide for some nice pictures on the North Sea coast, visiting North Frisia and Sylt, the Lower Saxon coast as well as a monumental rally in leftist Hamburg. Some people might still feel “Habeck-envy”, but by tying yourself closer to him, his popularity might just carry over.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5064, \"fields\": {\"answer\": 4064, \"candidate\": 79, \"answer_feedback\": \"Kretschmann repeatedly showcased a recipe to win a general election as a Green - and your party has surprisingly good polling numbers in the South. By reaching out to moderate conservationists you might be able to catch the Söder-crowd right from under Laschet's feet.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5065, \"fields\": {\"answer\": 4065, \"candidate\": 79, \"answer_feedback\": \"The Greens are traditionally not very strong in the East, although half their official name stems from the former East German party <i>Alliance 90</i>. There are some promising enclaves in the big university cities, but the question remains if your message can reach into the disengaged countryside.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5066, \"fields\": {\"answer\": 4066, \"candidate\": 79, \"answer_feedback\": \"While you aren’t casting a broad net here, you do project strength, and the two candidates appreciate your help. In Mecklenburg-Vorpommern, you showcase your opposition to Nord Stream 2. Berlin is a traditional Green stronghold: you receive a heroes’ welcome in Kreuzberg.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5067, \"fields\": {\"answer\": 4067, \"candidate\": 79, \"answer_feedback\": \"Over time, this has been the preferred stance of most people - but it’s still a bit controversial on the political stage. There are concerns about this leading to a two-class society.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5068, \"fields\": {\"answer\": 4068, \"candidate\": 79, \"answer_feedback\": \"There is a tiny fragment of society - the “natural medicine” crowd - that forms a swing voter block between Greens and AfD. Your stance appeals to those people - and those people only. Your party has to do damage control and forces you to retract, but among the catastrophic fallout, they are seriously considering switching you out for Habeck. </br> Tread lightly.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5069, \"fields\": {\"answer\": 4069, \"candidate\": 79, \"answer_feedback\": \"A vaccine mandate is pretty divisive. Your core voter base is open to this, but the majority still seems opposed. It unnerves liberals and young people in particular  - and, of course, you’re stirring the right-wing fear monger pot.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5070, \"fields\": {\"answer\": 4070, \"candidate\": 79, \"answer_feedback\": \"Your answer is uncontroversial, and your proposal proves to be quite popular. You’re still in the opposition and can’t affect a lot of policy, but dodging controversies might just be enough.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5523, \"fields\": {\"answer\": 4523, \"candidate\": 79, \"answer_feedback\": \"People detect a bit of a centrist pivot here. The Greens have been championing decriminalization and legalization throughout the last decade, and your new “small-step”-approach is certainly more careful than expected - activists are disappointed. Here’s hoping the inroads with suburban parents are worth it.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5524, \"fields\": {\"answer\": 4524, \"candidate\": 79, \"answer_feedback\": \"Many advised you to pivot to the center, to establish the Greens as a ‘Volkspartei’ - but this isn’t what they meant! Your oddly conservative stance gets a load of media attention, and your colleagues are horrified - individualism is a core tenet of the Greens! Shortly after you are forced to retract, and it’s embarrassing.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5525, \"fields\": {\"answer\": 4525, \"candidate\": 79, \"answer_feedback\": \"This has been a pet issue of Green activists for years, and as times are changing, many feel like with you as chancellor, there’s finally real hope for cannabis reform. Your reassurance energizes them and endears you to many younger voters, who you need to turn out. They’re certainly hoping for a “green” future.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5526, \"fields\": {\"answer\": 4526, \"candidate\": 79, \"answer_feedback\": \"Been to the <i>Berghain</i> one too many times, Annalena? This stance is one discussed only in your party's urban chapters, and isn’t acceptable to even a majority of Greens. Scholz and Laschet immediately jump on your eccentric comments - journalists discuss how the Greens might not be ready to lead after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5071, \"fields\": {\"answer\": 4071, \"candidate\": 79, \"answer_feedback\": \"Your aggressive strategy gets you back into the headlines, and drags down Scholz’s favorabilities. You blunt his surge - but now, all three candidates have low numbers. This might be bad for turnout - and good for the CDU, whose voters seem to go to the polls no matter what.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5072, \"fields\": {\"answer\": 4072, \"candidate\": 79, \"answer_feedback\": \"Cutting your losses? While Laschet does get more aggressive towards Scholz, the Vice Chancellor just doesn’t lose his calm. Through your inaction, all that might be left now, is hope. That said, Scholz publicly said that you’re his preferred coalition partner: maybe change can be enacted as a junior-partner as well…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5073, \"fields\": {\"answer\": 4073, \"candidate\": 79, \"answer_feedback\": \"The thing is, people like Scholz’s boringness. They find him comfortable and stately, and most agree that he would be a good chancellor. That said, the media applauds you for your energized youthful rallies and you increasingly become more visible again- the bleeding stops, though you’ll still have a lot of work to do.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5074, \"fields\": {\"answer\": 4074, \"candidate\": 79, \"answer_feedback\": \"This is a good, progressive answer to motivate your base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5075, \"fields\": {\"answer\": 4075, \"candidate\": 79, \"answer_feedback\": \"As much as you’re trying to spin this, you’re still promising to raise taxes. This might be sound economically, but people are worried that your plans might be too costly and might make animal products unaffordable. Parties to your right have an easy route of attack, while even your left accuses you of indifference towards less affluent people.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5076, \"fields\": {\"answer\": 4076, \"candidate\": 79, \"answer_feedback\": \"This is a sound argument that’s supported by Keynesian economists with broader appeal to the voters you have to win. However, since a 2/3rds majority and approval by the states is needed to modify the constitution, you’ll certainly be dependent on the SPD and even the CDU to carry through after the election.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5077, \"fields\": {\"answer\": 4077, \"candidate\": 79, \"answer_feedback\": \"This sounds like a veiled offer to the FDP - who usually sits on the other side of the economic debate. Are The Greens undergoing a paradigm shift? After your fruitful alliance in the opposition, people seem to notice a small love affair between Greens and Liberals. Of course, SPD and Die Linke immediately take you to task on this, while Fundis are unnerved.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5078, \"fields\": {\"answer\": 4078, \"candidate\": 79, \"answer_feedback\": \"It’s true that the SPD and Greens are each other's preferred coalition partners, even looking back to 7 years of Red-Green under Gerhard Schröder. However, the party system of Germany has changed, and most think it improbable that there will be a two-party-majority for the both of you - meanwhile, you’re dodging the question of cooperating with Die Linke.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5079, \"fields\": {\"answer\": 4079, \"candidate\": 79, \"answer_feedback\": \"With this strong statement, you’re driving a harsher lane than Scholz, effectively silencing Laschet's attacks on you. This is certain to gather points among moderates, for many of whom this question was a hold-up to supporting you, but you also disappoint many younger voters and left-wingers in your base by disavowing leftist unity so frankly.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5080, \"fields\": {\"answer\": 4080, \"candidate\": 79, \"answer_feedback\": \"This plays right into Laschet's criticisms of you, and no matter how you spin it, it frightens moderates fearful of the successor-party of the SED. On the other hand, Die Linke is hot on finally entering into a federal government - but their anti-interventionist stance is hard to ignore. Maybe your clear advances can help soften them up.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5081, \"fields\": {\"answer\": 4081, \"candidate\": 79, \"answer_feedback\": \"You’ve taken a liking to the “Pasta-connection” of 2019, it seems. The FDP is more hesitant to reciprocate, but your message is clear - you’re looking for a Jamaica or a Traffic Light coalition. Since Die Linke might be hard to bargain with, this could be a cunning move of Realpolitik - just know, Lindner prefers the CDU as a partner.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5527, \"fields\": {\"answer\": 4527, \"candidate\": 79, \"answer_feedback\": \"Cautious, but realistic and solution-oriented. Feminism is one of the core tenets of Green politics, and your answer satisfies most advocates. The uncontroversial nature of this answer keeps the issue out of the limelight - that could be good, as conservatives concerned about climate change might still be in play for you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5528, \"fields\": {\"answer\": 4528, \"candidate\": 79, \"answer_feedback\": \"A steadfast progressive answer with credibility: your party has advocated for this all the way back to its founding in 1980! You remain the preferred option of feminists in this race - but keep in mind this might fuel a counter reaction from the right. Your stance is also slightly to the left of Scholz’, which might be useful, depending on your strategy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5529, \"fields\": {\"answer\": 4529, \"candidate\": 79, \"answer_feedback\": \"Why are you running in the first place, if it’s ‘fine as is’? Look, even if you want to keep the conversation on climate change, don’t contradict the overwhelming majority of your own party! After all, the Greens were born from the New Social Movements of the 60’s and 70’s - feminism is a core tenet of Green politics. Many women are disappointed.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5530, \"fields\": {\"answer\": 4530, \"candidate\": 79, \"answer_feedback\": \"A strong stance that pivots leftwards - you really seem to gamble that by dragging culture wars into this race, you can consolidate the left around you. Your internet presence is already under siege from right-wing trolls. That said, your language echoes that of Die Linke in 2017, which might open you up to more attacks from the center.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5082, \"fields\": {\"answer\": 4082, \"candidate\": 79, \"answer_feedback\": \"You seem to gamble that joining the mudslinging is worth it - given how you really are the only major candidate whose party wasn’t involved in this tragedy, you might have a point. Hopefully, this can still translate at the ballot box in a few weeks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5083, \"fields\": {\"answer\": 4083, \"candidate\": 79, \"answer_feedback\": \"While you’re probably a lot more outraged in private, for your campaign, you’re apparently building on calming emotions and strategic consideration. While CDU and SPD blame each other for the failure, maybe your candor will be noted positively.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5084, \"fields\": {\"answer\": 4084, \"candidate\": 79, \"answer_feedback\": \"This is a full-throated defense of a progressive refugee policy that’s appreciated by most of your voters. With several CDU and CSU politicians warning of another 2015, the battlelines are clearly set - although it’s unclear how realistic your plan is to get these people out of the country.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5085, \"fields\": {\"answer\": 4085, \"candidate\": 79, \"answer_feedback\": \"The Green Party voted for the Afghanistan mission and was even part of the government in 2001. This is oddly non-interventionist for a foreign policy expert like you - has Die Linke convinced you? Either way, your statement is promptly attacked from all sides as both unproductive and factually false.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5086, \"fields\": {\"answer\": 4086, \"candidate\": 79, \"answer_feedback\": \"Scholz has certainly outperformed expectations. Your advisors get out the oppo-research - let’s hope you can consolidate the left around you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5087, \"fields\": {\"answer\": 4087, \"candidate\": 79, \"answer_feedback\": \"While he’s still the favorite for many, he is your main opponent, and his many flaws might make him an easy target. Your advisors get out the oppo-research - time to rip the CDU a new one.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5088, \"fields\": {\"answer\": 4088, \"candidate\": 79, \"answer_feedback\": \"An optimistic pitch could rekindle the enthusiasm around your candidacy and to give you that last burst of momentum. People like concrete soundbites - let’s hope taking the high road helps you stand out!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5089, \"fields\": {\"answer\": 4089, \"candidate\": 79, \"answer_feedback\": \"Many question your judgment. The debate goes ahead without you - the Triell becomes another duel between SPD and CDU, as it was in the past. Meanwhile, you might just have relegated the Greens back to the status of a minor party. The duopoly between the Social Democrats and the Union reasserts itself, as Scholz takes away the win against Laschet.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5090, \"fields\": {\"answer\": 4090, \"candidate\": 79, \"answer_feedback\": \"Despite you competing for the same voters, Scholz didn’t expect an attack from you - however, his disavowal of a continuation of the GroKo defuses your criticism a bit. Laschet gets tempted to defend the Status Quo - but in polling afterwards, it’s clear how change is in the air. Both Scholz and you get good grades.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5091, \"fields\": {\"answer\": 4091, \"candidate\": 79, \"answer_feedback\": \"Laschet starts the debate by hitting Scholz on the Wirecard affair - and you keep piling it on. Under these circumstances, the Vice Chancellor clearly gets evasive and vague. However, most regard Laschet as the more aggressive questionnaire here, and you seem a bit invisible by comparison. His strategy seems to pay off, as he holds an edge in polling.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5092, \"fields\": {\"answer\": 4092, \"candidate\": 79, \"answer_feedback\": \"Ah, leftist infighting - but this might pay off. Scholz tries to waive your attacks away with platitudes, but you keep pressing. He seems ignorant, and with Laschet naturally weak on this issue, you have redrawn the battlelines once again. You’ve clearly defined yourself as the candidate for climate action, and your potential voters nod along.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5093, \"fields\": {\"answer\": 4093, \"candidate\": 79, \"answer_feedback\": \"You haven’t really prepared your talking points beforehand, and your instincts fail you. Your repeated rattling down of your policies doesn’t really resonate, while the other candidates ignore you. You disappear into the background in what clearly becomes a duel between Scholz and Laschet, in which the Vice Chancellor prevails.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5531, \"fields\": {\"answer\": 4531, \"candidate\": 79, \"answer_feedback\": \"Not many people watch the debate, but for those that did, it's agreed that Wissler made some good points about wealth inequality and social justice – this could prove decisive for Die Linke to enter the Bundestag once again, considering the polling.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5532, \"fields\": {\"answer\": 4532, \"candidate\": 79, \"answer_feedback\": \"Not many people watch the debate, but for those that did, it's agreed that Lindner proved his rhetorical talent in talking about digitalization and fiscal responsibility. If they match or surpass their performance from 2017, they might be an important partner in coalition talks for you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5533, \"fields\": {\"answer\": 4533, \"candidate\": 79, \"answer_feedback\": \"Not many people watch the debate, but for those that did, it’s agreed that Alexander Dobrindt made a surprisingly strong case for Laschet as the pragmatic heir of the Merkel era. This might help the CSU solidify its historical dominance in Bavaria, but it also garners some goodwill for the CDU chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5534, \"fields\": {\"answer\": 4534, \"candidate\": 79, \"answer_feedback\": \"Not many people watch the debate, but in the following days people get more attentive, as the media observes how Alice Weidel surprisingly stunned her opponents with her points on Covid lockdowns and the political status quo. This might drive more disaffected people to the AfD, once and for all solidifying them on the right edge of German politics…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5094, \"fields\": {\"answer\": 4094, \"candidate\": 79, \"answer_feedback\": \"Unfortunately, she refers to FFF’s party neutrality and refuses to appear with you, although she appreciates the outreach. Instead, you’re doing your rallies with an assortment of longtime Green heavyweights like Claudia Roth, Anton Hofreiter and Jürgen Trittin. Now, time to join your family in Potsdam and hope that voters are just as “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5095, \"fields\": {\"answer\": 4095, \"candidate\": 79, \"answer_feedback\": \"Robert is still broadly popular, especially in his home state of Schleswig-Holstein. Although some (including him) are still wistful about “chancellor Habeck”, your youthful dynamic on stage makes many voters curious about a Green-led government. Now, enjoy some time with your family in Potsdam, and let’s hope they’re “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5096, \"fields\": {\"answer\": 4096, \"candidate\": 79, \"answer_feedback\": \"Jarasch is happy that you’re helping in her efforts to turn the capital Green. Berlin is already a stronghold for your party, and you can be certain to pick up some more direct mandates there - maybe it’ll even extend to yours, since Potsdam is right nearby. It’s only a small trip home to your family: let’s hope Germany is “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5097, \"fields\": {\"answer\": 4097, \"candidate\": 79, \"answer_feedback\": \"The <i>Minischderbräsident</i> of Baden-Württemberg is positively surprised, but campaigns enthusiastically for your cause. Hopefully, this can net you some strong results in both urban and rural regions of the South. Now, it’s time to head home to your family in Potsdam, and hope the median voter is “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5098, \"fields\": {\"answer\": 4098, \"candidate\": 79, \"answer_feedback\": \"Merz competently rallies your rural conservative base and excites them for another victory. You show some backbone and confidence to your party. Now, it’s time now to huddle down in your home in Potsdam, and hope that you can accomplish your goal of “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5099, \"fields\": {\"answer\": 4099, \"candidate\": 79, \"answer_feedback\": \"Annalena, that’s, that’s a joke… right? …no? Alright shit, Michael, it’s too late to swap in Habeck now, just give her the appearance and we’ll try to bury it. What, the media already got wind of it? Oh god… okay, Annalena, play it off as “reconciliation” and “talking with everyone”, okay? Those media people will rip you a new one… better hope they’re “Ready, because you are”...\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5100, \"fields\": {\"answer\": 4100, \"candidate\": 79, \"answer_feedback\": \"For your likeability, this might be safer. However, some media outlets perceive you as somewhat invisible - some bombast couldn’t hurt your campaign. At least Laschet and Scholz will be easier to talk to later on.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5101, \"fields\": {\"answer\": 4101, \"candidate\": 79, \"answer_feedback\": \"These are some concrete steps that are well received among the populace. The Greens, including you, certainly have a cleaner image on this front - but in giving such a general critique, some smell hypocrisy in your failure to report your own extraparliamentary earnings on time, earlier this year.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5102, \"fields\": {\"answer\": 4102, \"candidate\": 79, \"answer_feedback\": \"Many people are outraged about this scandal and it doesn’t hurt to keep this on people’s minds.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5103, \"fields\": {\"answer\": 4103, \"candidate\": 79, \"answer_feedback\": \"The allegations against Scholz are a bit murky, but the public gets the message. Remember, the SPD is close to you politically, and dishing out attacks on his character could jeopardize your cooperation. Let’s hope Scholz won’t take off the velvet gloves concerning your candidacy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5104, \"fields\": {\"answer\": 4104, \"candidate\": 79, \"answer_feedback\": \"You’ve bolstered the credentials around your education, but they haven’t really stood to question. Furthermore, there seems to be confusion around what exactly your degree is, and why you’ve canceled your dissertation. The whole discourse really doesn’t help your image.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5105, \"fields\": {\"answer\": 4105, \"candidate\": 79, \"answer_feedback\": \"While your family is a bit wary about the personal nature of this race, this approach works well enough. People sympathize with your hustle and it particularly strengthens your credentials on family- and education policy. There are a few conservatives who are murmuring, but let’s be real - you don’t want to win those.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5106, \"fields\": {\"answer\": 4106, \"candidate\": 79, \"answer_feedback\": \"You’re not wrong, but the Greens are a big offender here - 85% in your party group are from a higher education, 12% didn’t even finish their degree. While you’re praised to have recognized the problem, you’ll have to do some convincing why you are the one qualified to change this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5107, \"fields\": {\"answer\": 4107, \"candidate\": 79, \"answer_feedback\": \"This deflection doesn’t really come off well. Voters with lower education mostly disagree with you. It’s not a big deal in this election, but at the margins, their votes could’ve been important.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5108, \"fields\": {\"answer\": 4108, \"candidate\": 79, \"answer_feedback\": \"Your media lawyer Christian Schertz reasserts your claims, and provides you with a spirited defense. Most experts see you in the right and your party comes to your aid, but the kerfuffle keeps the story in the news cycle.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5109, \"fields\": {\"answer\": 4109, \"candidate\": 79, \"answer_feedback\": \"The apology is sufficient for most, and although some wonder if you’re really ready for the spotlight, some revelations around plagiarism in a book Laschet wrote quickly shuts down the discourse around you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5110, \"fields\": {\"answer\": 4110, \"candidate\": 79, \"answer_feedback\": \"Ouch, Annalena! It’s still your name on the cover of the book. Throwing Michael under the bus like this is pretty spiteful, and behind the scenes, even your colleagues ask you to tone it down. Publicly, the story picks up steam, with people seeing through the deflections - your favorability noticeably tanks, and people are giving Scholz a second look…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5111, \"fields\": {\"answer\": 4111, \"candidate\": 79, \"answer_feedback\": \"While these are clearly deflections, the discourse does shift towards Laschet a bit, as more and more plagiarized passages of his are found. You took the bull by the horns, and in doing so, dragged the race into the mud - laughing at the sidelines stands Olaf Scholz, who seeks to gain from your confrontations…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5112, \"fields\": {\"answer\": 4112, \"candidate\": 79, \"answer_feedback\": \"Most people who are interested in your book are intrigued by your candidacy already, but this could endear them sustainably to your Green ideology. There are some complaints that the book is light on specific policies, but overall, it is quite well-received and helps get the message out.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5113, \"fields\": {\"answer\": 4113, \"candidate\": 79, \"answer_feedback\": \"Not a bad plan, but unfortunately, your book is just too lightweight for this strategy to work, despite the effort you’ve put into it. It gets mixed reviews from critics who expected something more complex and concrete on the details. It’s sure to rally academics already invested in your candidacy, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5114, \"fields\": {\"answer\": 4114, \"candidate\": 79, \"answer_feedback\": \"No harm, no foul - the book is certain to not have a big impact on your electoral strategy after all. Maybe that’s for the best, because let’s be real, most people don’t read anymore.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5115, \"fields\": {\"answer\": 4115, \"candidate\": 79, \"answer_feedback\": \"Over time, this has been the preferred stance of most people - but it’s still a bit controversial on the political stage. There are concerns about this leading to a two-class society.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5116, \"fields\": {\"answer\": 4116, \"candidate\": 79, \"answer_feedback\": \"There is a tiny fragment of society - the “natural medicine” crowd - that forms a swing voter block between Greens and AfD. Your stance appeals to those people - and those people only. Your party has to do damage control and forces you to retract, but among the catastrophic fallout, they are seriously considering switching you out for Habeck. </br> Tread lightly.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5117, \"fields\": {\"answer\": 4117, \"candidate\": 79, \"answer_feedback\": \"A vaccine mandate is pretty divisive. Your core voter base is open to this, but the majority still seems opposed. It unnerves liberals and young people in particular  - and, of course, you’re stirring the right-wing fear monger pot.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5118, \"fields\": {\"answer\": 4118, \"candidate\": 79, \"answer_feedback\": \"Your answer is uncontroversial, and your proposal proves to be quite popular while setting you apart from other parties.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5119, \"fields\": {\"answer\": 4119, \"candidate\": 79, \"answer_feedback\": \"After Laschet’s famous gaffe during the floods, you really do seem capable and sympathetic by contrast. Scholz has pretty much been neglected by the media for weeks - with him mostly out of the way, it’s up to you now to carry that sentiment all the way to the ballot box.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5120, \"fields\": {\"answer\": 4120, \"candidate\": 79, \"answer_feedback\": \"Most of your success does stem from voters who would’ve voted SPD before, and continuing that line to deliver the Coup-de-Grace really could hoist you over the top. However, be reminded that purely by its cultural impact, the core voter base of the SPD might stay loyal to their political home all the way to the end.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5121, \"fields\": {\"answer\": 4121, \"candidate\": 79, \"answer_feedback\": \"A lot of the core voters of Die Linke are unabashed socialists, but by gnawing at their margins, you really could knock them out of the Bundestag - as long as they don’t win a third direct mandate outside of Berlin. Let’s see if your gambit pays off.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5122, \"fields\": {\"answer\": 4122, \"candidate\": 79, \"answer_feedback\": \"Your motives are admirable, but there are probably no two parties that have as little overlap as you and the AfD. Your attacks galvanize the Alternative’s base and hold little electoral potential in store.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5123, \"fields\": {\"answer\": 4123, \"candidate\": 79, \"answer_feedback\": \"A pretty harsh tone that leaves Laschet unable to ignore these attacks. Your blows fly quite low and dominate the media chatter, but as voters get reminded of his numerous gaffes and the mask scandals earlier this year, the bad press for the CDU chair continues. Meanwhile, the “temperament” of Olaf Scholz in particular gets good grades.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5124, \"fields\": {\"answer\": 4124, \"candidate\": 79, \"answer_feedback\": \"A biting critique of Laschet’s record. While he tries counters with his own proposals, calling your concepts “prohibitory policies”, the environment is still mostly your turf. Meanwhile, Olaf Scholz does his own thing, playing to his strengths as a calm statesman - polls show a tie between your performances, with Laschet barely behind.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5125, \"fields\": {\"answer\": 4125, \"candidate\": 79, \"answer_feedback\": \"If anyone can make this attack, it’s you. Laschet rejects your allegations, but embraces the label of a “continuity-candidate”. Fortunately, your pitch for real change resonates - and the aggressive manner in which you’re pushing for it defines the debate. People found you strong, assertive and authentic, while the men on stage seemed lame. Nice!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5126, \"fields\": {\"answer\": 4126, \"candidate\": 79, \"answer_feedback\": \"You haven’t really prepared your talking points beforehand, and your instincts fail you. Your repeated rattling down of your policies doesn’t really resonate, while the other candidates ignore you. You disappear into the background in what clearly becomes a duel between Scholz and Laschet, in which the Vice Chancellor prevails.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5127, \"fields\": {\"answer\": 4127, \"candidate\": 79, \"answer_feedback\": \"Your pitch is received decently by viewers and pundits alike. However, the aggressive tone of Laschet and Scholz’ unwavering calmness dominate the media cycle in the coming days. Olaf Scholz seems the most competent to many, and despite your efforts, you’re treated like a third wheel.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5128, \"fields\": {\"answer\": 4128, \"candidate\": 79, \"answer_feedback\": \"Your plea is passionate and authentic, but perhaps, also expected. Laschet of course attacks you on your more controversial policies, while Scholz somewhat concurs with you, mostly keeping to himself. Viewers aren’t really sure who they agreed with the most, and the result of the Triell seems to be an uneventful three-way tie. At least you’re keeping up.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5129, \"fields\": {\"answer\": 4129, \"candidate\": 79, \"answer_feedback\": \"You tear into Laschet’s economic plans, but so does Scholz, although a bit less aggressively. The narrative of the Triell seems to mostly revolve around the ideological rift: unfortunately, flanked by two Leftists, Laschet can define himself as a sensible centrist. It’s close, but he manages to consolidate Merkel’s coalition around him for a win in the polls.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5130, \"fields\": {\"answer\": 4130, \"candidate\": 79, \"answer_feedback\": \"You seem to let your frustrations get the best of you. You throw around attacks on Laschet’s character and call Scholz disingenuous, and even call out the narratives around you as “blatantly sexist”. Your opponents ignore your attacks, and while many of your followers are happy about your brutal honesty, most voters at home seem embarrassed.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5131, \"fields\": {\"answer\": 4131, \"candidate\": 79, \"answer_feedback\": \"You actually dare to say the quiet part out loud. While it’s true that people are certainly treating you differently from the other candidates, your deflections don’t come off well to the average voter. Sexism or not, your favorability numbers take a hit, especially in the wake of your outburst.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5132, \"fields\": {\"answer\": 4132, \"candidate\": 79, \"answer_feedback\": \"Your literary strategy does you some favors among people of higher education - but that’s a voting block you certainly don’t have problems with. Everyone else doesn’t really care, in fact, it makes you seem a bit elitist…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5535, \"fields\": {\"answer\": 4535, \"candidate\": 79, \"answer_feedback\": \"By sticking to your guns on climate, your core voters are mobilized, singing out the message far and wide. Other voters do still care about other topics though - as long as you can combine the enthusiasm around you with a broader appeal to change, your momentum could sweep you right into first place.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5536, \"fields\": {\"answer\": 4536, \"candidate\": 79, \"answer_feedback\": \"Some old Greens are warmly reminded of the rowdy, maoist 1960’s - but as they snap back to reality, even they fear how this rhetoric might land in the center of society. The Union immediately starts its fear mongering around you as a “radical ecosocialist” - and your prospects for a coalition with them or the FDP plummet.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5537, \"fields\": {\"answer\": 4537, \"candidate\": 79, \"answer_feedback\": \"Your pivot back to the center is noted by the media - while some activists are wary, the base is rallied sufficiently already. Your course-correction could prevent the worst among centrists, as long as you stay your course, but try not to seem like a political opportunist.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5538, \"fields\": {\"answer\": 4538, \"candidate\": 79, \"answer_feedback\": \"Casting a broad net is important, but there is significant concern about your leadership among Fundis. If you can overcome the internal quarrels though, your pitch might be well received by voters. Markus Söder even says a few good words about your campaign - Laschet must be seething.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5539, \"fields\": {\"answer\": 4539, \"candidate\": 79, \"answer_feedback\": \"The few Fundis that are still left take this as a direct slight towards them - Robert can contain a leadership challenge only at the last minute. To the media, this confirms your ongoing pivot to the Right: While you do hit the nerve of some voters, the Animal Protection Party also seems to gain traction these days, especially among students.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5540, \"fields\": {\"answer\": 4540, \"candidate\": 79, \"answer_feedback\": \"Many op-eds notice an increasing discrepancy between your past rhetoric and the new election posters you’re on. You seem like a bit of a flip-flopper - although your party members continue to defend you vehemently. Hopefully the voters won’t care.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5133, \"fields\": {\"answer\": 4133, \"candidate\": 79, \"answer_feedback\": \"Your chemistry is… a bit middling now, it turns out. You provide for some nice pictures on the North Sea coast, North Frisia, Sylt and Hamburg - but it’s clear how disappointed Habeck is that he isn’t the candidate. It leaks out to you that he’s planning to give some interviews after the election. Power really does change people, it seems.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5134, \"fields\": {\"answer\": 4134, \"candidate\": 79, \"answer_feedback\": \"Robert is still broadly popular, especially in his home state of Schleswig-Holstein. His appearance brings out the crowds, leaving many to doubt your refusal to embrace him more closely earlier on. Still, the rallies are an outstanding success. Now, enjoy some time with your family in Potsdam, and let’s hope Germany’s voters are “Ready, because you are”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5541, \"fields\": {\"answer\": 4541, \"candidate\": 79, \"answer_feedback\": \"Your own party takes you aside and tells you that it might actually not just be sexism. They agree that you’ve been treated by unfair standards, but something has to give - and most think, it’s you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5542, \"fields\": {\"answer\": 4542, \"candidate\": 79, \"answer_feedback\": \"Oh yes, they are. Think of Hillary Clinton - “likeability” seems to be a real thing for voters. Merkel herself willingly softened her image around 2015. Your party is unusually hesitant to defend you these days. Behind closed doors, the rumor is you aren’t taking this thing seriously.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5543, \"fields\": {\"answer\": 4543, \"candidate\": 79, \"answer_feedback\": \"Your renewed vigor and change in tactics could temporarily stop the bleeding, but your numbers are still abhorrent compared to the beginning of this campaign. The party is happy that you’ve recognized the problem and are doing something about it, but it will take a lot more than this to make an epic comeback.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5544, \"fields\": {\"answer\": 4544, \"candidate\": 79, \"answer_feedback\": \"Robert understands. He talks it over with the party bosses, who are a bit relieved. Within a week, they prepared statements for the both of you. It is a hard moment, stepping in front of the camera, and announcing your unprecedented retreat from the candidacy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5545, \"fields\": {\"answer\": 4545, \"candidate\": 79, \"answer_feedback\": \"People find this tone a bit uncomfortable. Your own party takes you aside and tells you that while these rants are warranted, electorally, they’re counterproductive. Nevermind how unfairly you’ve been treated, you’ll quickly have to turn this ship around if you want to appeal to the voters you need to change Germany for the better.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5546, \"fields\": {\"answer\": 4546, \"candidate\": 79, \"answer_feedback\": \"Unfortunately, they kind of are. Think of Hillary Clinton - “likeability” seems to be a real thing for voters. Merkel herself willingly softened her image around 2015. Robert calls the rumors “Kokolores” and doesn’t budge, but you’re still increasingly criticized internally. Better amend some relations for the coalition talks, in case you don’t win this after all.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5547, \"fields\": {\"answer\": 4547, \"candidate\": 79, \"answer_feedback\": \"Your renewed vigor and change in tactics might’ve saved you from disaster, but let this be a warning. This country might not be fair to you, but nonetheless, you’re running for chancellor in it - better be more thoroughly prepared for the end of the campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5548, \"fields\": {\"answer\": 4548, \"candidate\": 79, \"answer_feedback\": \"Robert understands. He talks it over with the party bosses, and within a week, they prepared statements for the both of you. It is a hard moment, stepping in front of the camera, and announcing your unprecedented retreat from the candidacy.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5549, \"fields\": {\"answer\": 4549, \"candidate\": 79, \"answer_feedback\": \"Some believe you have a point, but your strict tone is still turning voters off. Your party of course agrees and stands by your side, especially Robert, who is vigorous to prove his loyalty - but the media still sees this as a deflection. Either way, you’ll have to quickly turn this ship around, else your career might be over.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5550, \"fields\": {\"answer\": 4550, \"candidate\": 79, \"answer_feedback\": \"Unfortunately, they kind of are. Think of Hillary Clinton - “likeability” seems to be a real thing for voters. Merkel herself willingly softened her image around 2015. Your party doesn’t budge from you as their choice for a candidate, especially Robert, who dismissively laughs about the speculations - but it’s an issue that this came up in the first place.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5551, \"fields\": {\"answer\": 4551, \"candidate\": 79, \"answer_feedback\": \"Your renewed vigor and change in tactics quickly quells any rumors and issues about this topic. It might be a tad cynical that it takes the “housewife”-card, but your numbers with older voters noticeably improve. Your party continues to stand by your side, unequivocally.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5552, \"fields\": {\"answer\": 4552, \"candidate\": 79, \"answer_feedback\": \"Hey, I know it’s hard, but you’re overreacting. Your advisor Michael takes you aside and talks it over, and Robert assures you, he deferred to you for a reason. He’s ready to take on a bigger role for the campaign, but you have to ride this out. </br>\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5553, \"fields\": {\"answer\": 4553, \"candidate\": 79, \"answer_feedback\": \"Lucky you - you were right, this race needed a woman, and passion for the good fight. Keep it up, and you very well might become the second female chancellor in Germany.\"}}]");
